{"UID": "CHE-108.692.324", "publication_text": "Change Technovis GmbH, Stammheim, new Steckborn     Technovis GmbHOesterlohstrasse 38266 Steckborn           To date M\u00fcsliweg 298476 Unterstammheim             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Technovis GmbH, bisher in Stammheim, CHE-108.692.324, Gesellschaft mit beschr\u00e4nkter Haftung (SHAB Nr. 9 vom 15.01.2019, Publ. 1004541363). Statuten\u00e4nderung: 29.01.2021. 11.02.2021. Sitz neu: Steckborn. Domizil neu: Oesterlohstrasse 3, 8266 Steckborn. Zweck neu: Die Gesellschaft bezweckt den Import - Export und Handel, mit Waren aller Art, insbesondere Automobilen, Motoren und Automobilersatzteilen aller Art sowie den Betrieb von Garagen mit den verwandten Gesch\u00e4ftsbereichen. Die Gesellschaft erbringt ferner s\u00e4mtliche Dienstleistungen im Zusammenhang mit Fahrzeugen und Industrieg\u00fctern, insbesondere auch den Kauf und Verkauf von Verpackungsmaschinen und -anlagen und Maschinen und Anlagen angrenzender Gebiete. Die Gesellschaft bezweckt weiter amtliche und private Liquidationen, Sch\u00e4tzungen, Erbschafts- und Nachlassverwaltungen sowie Restposten-Verwertungen. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. Eingetragene Personen neu oder mutierend: Erb, Marco Peter, von Winterthur, in Steckborn, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 200 Stammanteilen zu je CHF 100.00 [bisher: Erb-Dolff, Marco Peter, in Unterstammheim]; Erb, Doris, von Winterthur, in Steckborn, mit Einzelunterschrift.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1309 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 9, Date: 15.01.2019       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Thurgau", "company_name": "Technovis GmbH", "address": "Oesterlohstrasse 3", "zip_code": "8266", "town": "Steckborn", "publication_title": "Change Technovis GmbH, Stammheim, new Steckborn", "url": "https://shab.ch/#!/search/publications/detail/6d0c32f7-fc09-4fff-bc41-e9a24ce34fa7", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121585", "journal_number": "1309", "journal_date": "08.03.2021"}
{"UID": "CHE-106.820.551", "publication_text": "Change Sch\u00f6nenberger & Partner AG Sanit\u00e4re Anlagen, Tobel-T\u00e4gerschen     Sch\u00f6nenberger & Partner AG Sanit\u00e4re AnlagenFliegeneggstrasse 139555 Tobel             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Sch\u00f6nenberger & Partner AG Sanit\u00e4re Anlagen, in Tobel-T\u00e4gerschen, CHE-106.820.551, Aktiengesellschaft (SHAB Nr. 117 vom 19.06.2020, Publ. 1004915384). Statuten\u00e4nderung: 03.03.2021. Zweck neu: Die Gesellschaft bezweckt die F\u00fchrung eines Fachbetriebes f\u00fcr Heizung, L\u00fcftung, Klima, Sanit\u00e4r und Haustechnik, alle damit im Zusammenhang stehenden Arbeiten und Reparaturen, Unterhalt, den Handel mit entsprechenden Apparaten und Ger\u00e4ten sowie den Erwerb, die Verwertung und Ver\u00e4usserung von Lizenzen, sowie die Planung und Realisierung von haustechnischen Einrichtungen aller Art. Im \u00dcbrigen kann die Gesellschaft alle Gesch\u00e4fte t\u00e4tigen, welche der Wahrung und F\u00f6rderung der Konzerninteressen dienen. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten, sich an anderen Unternehmen des In- und Auslandes beteiligen, gleichartige oder verwandte Unternehmen erwerben oder sich mit solchen zusammenschliessen, Grundst\u00fccke im In- und Ausland erwerben, belasten und ver\u00e4ussern sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit dem Gesellschaftszweck im Zusammenhang stehen. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Konzerngesellschaften und Dritte eingehen. Qualifizierte Tatbest\u00e4nde neu: [gestrichen: Beabsichtigte Sach\u00fcbernahme: Die Gesellschaft beabsichtigt, nach der Gr\u00fcndung von der im Handelsregister eingetragenen Einzelfirma Sch\u00f6nenberger Sanit\u00e4r, in Rickenbach TG, Mobiliar, Fahrzeuge, Maschinen und Einrichtungen sowie Warenvorr\u00e4te zum Preis von maximal CHF 200'000.-- zu \u00fcbernehmen.]. Mitteilungen neu: Mitteilungen der Gesellschaft an die im Aktienbuch eingetragenen Aktion\u00e4re erfolgen schriftlich (inkl. E-Mail).       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1303 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 117, Date: 19.06.2020       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Thurgau", "company_name": "Sch\u00f6nenberger &amp; Partner AG Sanit\u00e4re Anlagen", "address": "Fliegeneggstrasse 13", "zip_code": "9555", "town": "Tobel", "publication_title": "Change Sch\u00f6nenberger & Partner AG Sanit\u00e4re Anlagen, Tobel-T\u00e4gerschen", "url": "https://shab.ch/#!/search/publications/detail/d378dc38-8053-4e5f-93ed-c745a23a6906", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121579", "journal_number": "1303", "journal_date": "08.03.2021"}
