{"UID": "CHE-112.266.692", "publication_text": "Change TOR BECK AG, Rapperswil-Jona, new TOR BECK AG in Liquidation     TOR BECK AG in LiquidationMolkereistrasse 58645 Jona             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  TOR BECK AG, in Rapperswil-Jona, CHE-112.266.692, Aktiengesellschaft (SHAB Nr. 232 vom 29.11.2011, S.0, Publ. 6436004). Firma neu: TOR BECK AG in Liquidation. Zweck neu: Zweck der Gesellschaft ist der Betrieb einer B\u00e4ckerei und Detailhandel im Food- und Non-Food-Bereich. Sie kann damit zusammenh\u00e4ngende Dienstleistungen erbringen und vermitteln, Finanzierungen durchf\u00fchren, in der Schweiz und im Ausland Tochtergesellschaften errichten und sich an anderen Unternehmen beteiligen oder sich mit diesen zusammenzuschliessen. Die Gesellschaft kann Grundst\u00fccke erwerben, verwalten, belasten und ver\u00e4ussern sowie alle Gesch\u00e4fte eingehen und Vertr\u00e4ge abschliessen, die geeignet sind, den Gesch\u00e4ftszweck der Gesellschaft zu f\u00f6rdern oder direkt oder indirekt mit diesem im Zusammenhang stehen. [Eintrag aufgrund ge\u00e4nderter Eintragungsvorschriften.]. Mitteilungen neu: Die Mitteilungen an die im Aktienbuch eingetragenen Namenaktion\u00e4re erfolgen durch eingeschriebenen Brief, an die Inhaberaktion\u00e4re durch Ver\u00f6ffentlichung im Publikationsorgan oder an die letzte der Gesellschaft bekanntgegebene Adresse durch eingeschriebenen Brief. [Anpassung aufgrund ge\u00e4nderter Eintragungsvorschriften.]. Vinkulierung neu: [Die Beschr\u00e4nkung der \u00dcbertragbarkeit der Namenaktien ist im Sinne von Art. 685a Abs. 3 OR aufgehoben.]. Die Gesellschaft ist mit Beschluss der Generalversammlung vom 04.03.2021 aufgel\u00f6st. Eingetragene Personen neu oder mutierend: Philipp, Beat, von Schattdorf, in Pf\u00e4ffikon SZ (Freienbach), Pr\u00e4sident des Verwaltungsrates, Liquidator, mit Kollektivunterschrift zu zweien [bisher: Pr\u00e4sident des Verwaltungsrates, mit Kollektivuntersc