{"UID": "CHE-108.753.003", "publication_text": "Change Lehag AG, Rorschacherberg     Lehag AGLangmoosweg 18a9404 Rorschacherberg             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Lehag AG, in Rorschacherberg, CHE-108.753.003, Aktiengesellschaft (SHAB Nr. 190 vom 01.10.2012, S.0, Publ. 6870090). Statuten\u00e4nderung: 05.03.2021. Zweck neu: Die Gesellschaft bezweckt die Ausf\u00fchrung von Gartenbauarbeiten, Landschaftsgestaltung, Planung, Verkauf, Einrichten und Unterhalt von Biotopschwimmteichen sowie die Erforschung und Entwicklung von \u00dcberlebensstrategien auf engstem Raum und die Verwaltung von Gesellschaftseigentum. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. [Anpassung aufgrund ge\u00e4nderter Eintragungsvorschriften]. Aktien neu: 100 Namenaktien zu CHF 1'000.00 [bisher: 100 Inhaberaktien zu CHF 1'000.00]. Mitteilungen neu: Mitteilungen an die Aktion\u00e4re erfolgen per Brief oder E-Mail an die im Aktienbuch verzeichneten Adressen. Vinkulierung neu: Die \u00dcbertragbarkeit der Namenaktien ist nach Massgabe der Statuten beschr\u00e4nkt. Eingetragene Personen neu oder mutierend: Steiger, Alfred, von Nesslau, in Rorschacherberg, Pr\u00e4sident des Verwaltungsrates, mit Einzelunterschrift [bisher: von Nesslau-Krummenau, Pr\u00e4sident, mit Einzelunterschrift]; Steiger, Patrik, von Nesslau, in Meilen, Mitglied des Verwaltungsrates, mit Einzelunterschrift [bisher: von Nesslau-Krummenau, in M\u00e4nnedorf, Mitglied, mit Einzelunterschrift]. [Anpassung Heimatorte von Amtes wegen bzw. beh\u00f6rdliche Um\u00e4nderung].       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 2473 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 190, Date: 01.10.2012       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Amt f\u00fcr Handelsregister und Notariate Kanton SG", "company_name": "Lehag AG", "address": "Langmoosweg 18a", "zip_code": "9404", "town": "Rorschacherberg", "publication_title": "Change Lehag AG, Rorschacherberg", "url": "https://shab.ch/#!/search/publications/detail/d182b84e-0a48-4e97-bcdc-185c97b84be4", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121431", "journal_number": "2473", "journal_date": "08.03.2021"}
