{"UID": "CHE-188.957.854", "publication_text": "Change G16 S\u00e0rl, P\u00e9ry-La Heutte, new Orvin     G16 S\u00e0rlL'Echelette 72534 Orvin           To date Grand'Rue 542603 P\u00e9ry             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  G16 S\u00e0rl, \u00e0 P\u00e9ry-La Heutte, CHE-188.957.854, soci\u00e9t\u00e9 \u00e0 responsabilit\u00e9 limit\u00e9e (No. FOSC 143 du 27.07.2020, Publ. 1004945406). Modification des statuts: 02.03.2021. Nouveau si\u00e8ge: Orvin. Nouvelle adresse: L'Echelette 7, 2534 Orvin. Nouveau but: La soci\u00e9t\u00e9 a pour but l'ex\u00e9cution de tous mandats se rattachant \u00e0 l'activit\u00e9 d'une soci\u00e9t\u00e9 fiduciaire, notamment la tenue de comptabilit\u00e9, le conseil en mati\u00e8re d'\u00e9tablissement et de pr\u00e9sentation des comptes, le conseil et la repr\u00e9sentation en mati\u00e8re fiscale, la g\u00e9rance de fortune mobili\u00e8re et immobili\u00e8re et la r\u00e9vision comptable. Elle peut cr\u00e9er des succursales en Suisse et \u00e0 l'\u00e9tranger, participer \u00e0 d'autres entreprises en Suisse et \u00e0 l'\u00e9tranger, acqu\u00e9rir des entreprises visant un but identique ou analogue, ou fusionner avec de telles entreprises, acqu\u00e9rir ou vendre des immeubles, faire toutes op\u00e9rations et conclure tous contrats propres \u00e0 d\u00e9velopper et \u00e0 \u00e9tendre son but ou s'y rapportant directement ou indirectement. Nouvel organe de publication: FOSC. Nouvelles communications: Communications aux associ\u00e9s: par courrier \u00e9crit, par t\u00e9l\u00e9fax ou courrier \u00e9lectronique. Selon d\u00e9claration du 22.05.2018, il est renonc\u00e9 \u00e0 un contr\u00f4le restreint. [pr\u00e9c\u00e9demment: Gem\u00e4ss Erkl\u00e4rung vom 22.05.2018 wurde auf die eingeschr\u00e4nkte Revision verzichtet.]. Inscription ou modification de personne(s): Hirschi, Ga\u00ebtan, de La Chaux-de-Fonds, \u00e0 Biel/Bienne, associ\u00e9 et g\u00e9rant, avec signature individuelle, pour 20 parts sociales de CHF 1'000.00 [pr\u00e9c\u00e9demment: \u00e0 P\u00e9ry (P\u00e9ry-La Heutte)]. Les inscriptions au registre du commerce ont \u00e9t\u00e9 traduites et sont op\u00e9r\u00e9es nouvellement en langue fran\u00e7aise.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 3930 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 143, Date: 27.07.2020       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Bern", "company_name": "G16 S\u00e0rl", "address": "L'Echelette 7", "zip_code": "2534", "town": "Orvin", "publication_title": "Change G16 S\u00e0rl, P\u00e9ry-La Heutte, new Orvin", "url": "https://shab.ch/#!/search/publications/detail/2c93db61-96b3-47b1-b6e5-1e77a8c095a4", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121037", "journal_number": "3930", "journal_date": "08.03.2021"}
