{"UID": "CHE-416.752.102", "publication_text": "New entries LANO AG, Rothrist     LANO AGNatternweg 364852 Rothrist             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  LANO AG, in Rothrist, CHE-416.752.102, Natternweg 36, 4852 Rothrist, Aktiengesellschaft (Neueintragung). Statutendatum: 26.02.2021. Zweck: Die Gesellschaft bezweckt das Kaufen, Verkaufen, Halten, Verwalten und die Bewirtschaftung von Liegenschaften. Die Gesellschaft erbringt ferner Dienstleistungen im Bereich Baurenovationen und betreibt Handel mit Waren aller Art, insbesondere von Baumaterialien. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. Aktienkapital: CHF 100'000.00. Liberierung Aktienkapital: CHF 100'000.00. Aktien: 100 Namenaktien zu CHF 1'000.00. Publikationsorgan: SHAB. Mitteilungen an die Aktion\u00e4re erfolgen per Brief, E-Mail oder Telefax an die im Aktienbuch verzeichneten Adressen. Gem\u00e4ss Erkl\u00e4rung der Gr\u00fcnder vom 26.02.2021 untersteht die Gesellschaft keiner ordentlichen Revision und verzichtet auf eine eingeschr\u00e4nkte Revision. Eingetragene Personen: Ilieski, Daliborka, von Aarburg, in Rothrist, Pr\u00e4sidentin des Verwaltungsrates, mit Kollektivunterschrift zu zweien; Zovkic, Ivo, von Zofingen, in Strengelbach, Mitglied des Verwaltungsrates, mit Kollektivunterschrift zu zweien.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 3099 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2