ribution de tous types de produits, mobili\u00e8res ou immobili\u00e8res, cr\u00e9er des succursales ou des filiales en Suisse et \u00e0 l'\u00e9tranger (inclus l'import/export et distribution de tous types de produits), participer \u00e0 toutes entreprises soci\u00e9t\u00e9s nationales et \u00e9trang\u00e8res, ayant un rapport direct ou indirect avec son but et accorder des pr\u00eats ou des garanties \u00e0 des associ\u00e9s ou des tiers, si cela favorise ses int\u00e9r\u00eats. Capital: CHF 20'000. Organe de publication: Feuille Officielle Suisse du Commerce. Communication aux associ\u00e9s: par lettre ou par courriel. Associ\u00e9e-g\u00e9rante: Courvoisier Tetiana, d'Ukraine, \u00e0 Gen\u00e8ve, pour 200 parts de CHF 100, avec signature individuelle. Selon d\u00e9claration du 03.02.2021, il est renonc\u00e9 \u00e0 un contr\u00f4le restreint.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4969 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Canton de Gen\u00e8ve", "company_name": "Geneva Business Performance S\u00e0rl", "address": "Rue Denis-De-Rougemont 14", "zip_code": "1202", "town": "Gen\u00e8ve", "publication_title": "New entries Geneva Business Performance S\u00e0rl, Gen\u00e8ve", "url": "https://shab.ch/#!/search/publications/detail/4bff8ef2-6e14-4c29-a287-273eebf9f1a8", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121926", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-406.709.978", "publication_text": "New entries Revey Immobilier S\u00e0rl, Sierre     Revey Immobilier S\u00e0rlChemin des Noyerets 13960 Sierre             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Revey Immobilier S\u00e0rl, \u00e0 Sierre, CHE-406.709.978, Chemin des Noyerets 1, Case postale 829, 3960 Sierre, soci\u00e9t\u00e9 \u00e0 responsabilit\u00e9 limit\u00e9e (Nouvelle inscription). Date des statuts: 01.03.2021. But: La soci\u00e9t\u00e9 a pour but d'exercer toute op\u00e9ration dans le domaine immobilier et mobilier, notamment I'acquisition, I'administration, I'ali\u00e9nation, le commerce de biens et services, le conseil, le courtage, la construction, la d\u00e9tention, l'entretien, I'ex\u00e9cution et le suivi de travaux, la gestion, l'investissement, la location, le mandat, la mise en valeur, la promotion, la r\u00e9alisation de plans et de proiets, le rendement, la r\u00e9novation, la r\u00e9paration et la vente concernant des biens immobiliers et mobiliers ainsi que des valeurs mobili\u00e8res. Par ailleurs, la soci\u00e9t\u00e9 peut r\u00e9aliser, soit pour son propre compte, soit pour le compte de tiers, toute affaire mobili\u00e8re et immobili\u00e8re de mani\u00e8re g\u00e9n\u00e9rale, tout mandat et conseil dans le domaine des affaires et de la finance ainsi que toute op\u00e9ration d'investissement, commerciale, financi\u00e8re, mobili\u00e8re, immobili\u00e8re et industrielle convergente. La soci\u00e9t\u00e9 peut fusionner avec des entreprises ayant un but analogue, acqu\u00e9rir, participer \u00e0 d'autres entreprises et constituer des succursales et des filiales. Toutes ces op\u00e9rations peuvent s'effectuer en rapport direct ou indirect avec le but social, tant en Suisse qu'\u00e0 l'\u00e9tranger, \u00e0 l'exception des op\u00e9rations prohib\u00e9es par la LFAIE. Capital social: CHF 20'000.00. Obligations de fournir des prestations accessoires, droits de pr\u00e9f\u00e9rence, de pr\u00e