{"UID": "CHE-233.797.530", "publication_text": "New entries Margaret SA, Gen\u00e8ve     Margaret SAQuai du Mont-Blanc 31201 Gen\u00e8ve             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Margaret SA, \u00e0 Gen\u00e8ve, Quai du Mont-Blanc 3, 1201 Gen\u00e8ve, CHE-233.797.530. Nouvelle soci\u00e9t\u00e9 anonyme. Statuts du 23.02.2021. But: la fabrication, la vente et la distribution de tous produits, en particulier dans le domaine de la bijouterie et de la joaillerie et toute activit\u00e9 li\u00e9e; la soci\u00e9t\u00e9 peut en outre faire, soit pour son propre compte, soit pour le compte de tiers, toutes op\u00e9rations commerciales, mobili\u00e8res et financi\u00e8res, en relation directe ou indirecte avec son but, sous quelque forme que ce soit, notamment sous forme de participations; la soci\u00e9t\u00e9 peut ouvrir des succursales en Suisse et \u00e0 l'\u00e9tranger, fonder ou acqu\u00e9rir toute entreprise poursuivant un but analogue ou compl\u00e9mentaire; la soci\u00e9t\u00e9 peut accorder des pr\u00eats ou toutes garanties soit \u00e0 ses actionnaires, soit \u00e0 des tiers. Capital-actions: CHF 240'000, enti\u00e8rement lib\u00e9r\u00e9, divis\u00e9 en 2'400 actions de CHF 100, nominatives, li\u00e9es selon statuts. Apport en nature et reprise de biens: les actifs et passifs relatifs \u00e0 l'exploitation de FINANCE & GEMSTONE MARGARET LIMITED, Londres, succursale de Gen\u00e8ve, \u00e0 Gen\u00e8ve (CHE-113.000.004), selon contrat du 23.02.2021 et bilan au 31.12.2020, comportant un actif de CHF 434'615.05 et un passif envers les tiers de CHF 193'039.84, soit un actif net de CHF 241'575.21 en contrepartie duquel sont remises 2'400 actions de CHF 100, nominatives li\u00e9es, le solde de CHF 1'575.21 \u00e9tant port\u00e9 au cr\u00e9dit de l'apporteur. Organe de publication: Feuille Officielle Suisse du Commerce. Communication aux actionnaires: lettre recommand\u00e9e ou email avec accus\u00e9 de r\u00e9ception. Administration: Melamed Oriana, de et \u00e0 Gen\u00e8ve, pr\u00e9sidente, et Ophir Candice, de Cologny, \u00e0 Vandoeuvres, toutes deux avec signature individuelle. Selon d\u00e9claration du 23.02.2021, il est renonc\u00e9 \u00e0 un contr\u00f4le restreint.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4971 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Canton de Gen\u00e8ve", "company_name": "Margaret SA", "address": "Quai du Mont-Blanc 3", "zip_code": "1201", "town": "Gen\u00e8ve", "publication_title": "New entries Margaret SA, Gen\u00e8ve", "url": "https://shab.ch/#!/search/publications/detail/b3f1c15f-9b29-4aac-89fb-173f2c06602e", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121948", "journal_number": "no data", "journal_date": "no data"}
