{"UID": "CHE-114.521.056", "publication_text": "Change AFA Aston Fides Associates GmbH, Z\u00fcrich, new cmv group GmbH     cmv group GmbHAsylstrasse 418032 Z\u00fcrich           To date AFA Aston Fides Associates GmbH              \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  AFA Aston Fides Associates GmbH, in Z\u00fcrich, CHE-114.521.056, Gesellschaft mit beschr\u00e4nkter Haftung (SHAB Nr. 63 vom 31.03.2020, Publ. 1004862651). Statuten\u00e4nderung: 01.03.2021. Firma neu: cmv group GmbH. Zweck neu: Die Gesellschaft bezweckt den Erwerb, das Halten, die Verwaltung und Ver\u00e4usserung von Beteiligungen an Unternehmen im Finanz- und Verm\u00f6gensverwaltungs-, Immobilien-, Gastronomie-, Tourismus-, Versicherungs- und im Oel-, Beratungsbereich und damit zusammenh\u00e4ngenden Dienstleistungen. Ein weiterer Zweck der Gesellschaft ist Herstellung von und Handel mit kosmetischen Produkten, die Betreibung eines online Vertriebs Shops. Entwicklung und Verwertung von Herstellungsverfahren und gewerblichen Schutzrechten, \u00dcbernahme und Gew\u00e4hrung von Lizenzen, Produktion und Handel in eigenem und fremdem Namen mit Rohstoffen, pflanzlichen Stoffen und industriellen Erzeugnissen f\u00fcr die Kosmetikbranche. Erwerb, Verwertung und Verwaltung von Patenten, Lizenzen, Konzessionen, Handels- und Fabrikmarken und \u00e4hnlichen Rechten. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen. Die Gesellschaft kann Grundst\u00fccke erwerben, halten und ver\u00e4ussern. Die Gesellschaft kann alle kommerziellen, finanziellen und anderen T\u00e4tigkeiten aus\u00fcben, welche mit dem Zweck der Gesellschaft im Zusammenhang stehen. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen.       \u2002\u2002  \u2002\u2002\u2002\u2002\u