{"UID": "CHE-412.551.088", "publication_text": "New entries Nhombers S\u00e0rl, Gen\u00e8ve     Nhombers S\u00e0rlc/o BENBEN Creative Design S\u00e0rlRue du Grand-Pr\u00e9 21202 Gen\u00e8ve             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Nhombers S\u00e0rl, \u00e0 Gen\u00e8ve, Rue du Grand-Pr\u00e9 2, c/o BENBEN Creative Design S\u00e0rl, 1202 Gen\u00e8ve, CHE-412.551.088. Nouvelle soci\u00e9t\u00e9 \u00e0 responsabilit\u00e9 limit\u00e9e. Statuts du 26.02.2021. But: la conceptualisation, la commercialisation et la vente de designs architecturaux pour la construction de biens immobiliers; la d\u00e9tention des droits de propri\u00e9t\u00e9 intellectuelle sur des designs d\u00e9pos\u00e9s aupr\u00e8s de l'OMPI et la commercialisation de leur utilisation; toutes prestations de conseils en lien avec le design architectural; la soci\u00e9t\u00e9 peut en outre faire, soit pour son propre compte, soit pour le compte de tiers, toutes op\u00e9rations commerciales, mobili\u00e8res et financi\u00e8res, en relation directe ou indirecte avec son but, sous quelque forme que ce soit, notamment sous forme de participations; la soci\u00e9t\u00e9 peut ouvrir des succursales en Suisse et \u00e0 l'\u00e9tranger, fonder ou acqu\u00e9rir toute entreprise poursuivant un but analogue ou compl\u00e9mentaire; la soci\u00e9t\u00e9 peut accorder des pr\u00eats ou toutes garanties soit \u00e0 ses associ\u00e9s, soit \u00e0 des tiers. Obligation de fournir des prestations accessoires, droits de pr\u00e9f\u00e9rence, de pr\u00e9emption ou d'emption: pour les d\u00e9tails, voir les statuts. Capital: CHF 20'000. Organe de publication: Feuille Officielle Suisse du Commerce. Communication aux associ\u00e9s: : par \u00e9crit ou par email (convocation par \u00e9crit, fax ou courriel). Associ\u00e9s: Bensoussan Yaniv, de France, \u00e0 Etrembi\u00e8res, FRA, pour 66 parts de CHF 200, Levy \u00e9p. Bensoussan Dina, de France, \u00e0 Etrembi\u00e8res, FRA, pour 33 parts de CHF 200, et Comte Estelle, de France, \u00e0 Saint-Genix-les-Villages, FRA, pour 1 part de CHF 200. G\u00e9rants: l'associ\u00e9 Bensoussan Yaniv, pr\u00e9sident, l'associ\u00e9e Levy \u00e9p. Bensoussan Dina, et Duplan Marie, de Yens, \u00e0 Morges, tous trois avec signature individuelle. L'associ\u00e9e Comte Estelle n'exerce pas la signature sociale. Selon d\u00e9claration du 26.02.2021, il est renonc\u00e9 \u00e0 un contr\u00f4le restreint.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4974 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Canton de Gen\u00e8ve", "company_name": "Nhombers S\u00e0rl", "address": "Rue du Grand-Pr\u00e9 2", "zip_code": "1202", "town": "Gen\u00e8ve", "publication_title": "New entries Nhombers S\u00e0rl, Gen\u00e8ve", "url": "https://shab.ch/#!/search/publications/detail/2d06f161-0513-4a41-ac2d-f40cb844d16c", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121838", "journal_number": "no data", "journal_date": "no data"}
