{"UID": "CHE-435.883.259", "publication_text": "Change R.I.S. DENTAL SA (RESEARCH, IMPLANTHOLOGY AND SURGERY), Lugano     R.I.S. DENTAL SA (RESEARCH, IMPLANTHOLOGY AND SURGERY)Via al Fiume 76962 Viganello             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  R.I.S. DENTAL SA (RESEARCH, IMPLANTHOLOGY AND SURGERY), in Lugano, CHE-435.883.259, societ\u00e0 anonima (Nr. FUSC 17 del 26.01.2021, Pubbl. 1005083854). Statuti modificati: 05.03.2021. Nuovo scopo: L'import-export e il commercio in genere di macchinari, strumenti, articoli medici, odontoiatrici e farmaceutici. La fornitura di servizi e strutture idonei all'esecuzione e alla gestione di studi medici, ambulatori e istituti specialistici e polispecialistici. La realizzazione di procedure diagnostiche, terapeutiche chirurgiche nel settore dell'odontoiatria. Conduzione e gestione diretta di gabinetti diagnostici, di radiologia, odontoiatria, chirurgia orale e maxillofacciale, chirurgia plastica e ricostruttiva, e la consulenza a terzi per tutte le attivit\u00e0 mediche ed odontoiatriche. Prestazioni mediche specialistiche anche presso terzi di protesi dentale, ortodonzia, stomatologia infantile, chirurgia orale ed implantologia. Interventi riguardanti la realizzazione di manufatti fissi e mobili atti alla terapia di ogni tipo di malformazione maxillofacciale, malocclusione dentaria oltre che estetica. La societ\u00e0 potr\u00e0 inoltre organizzare convegni, manifestazioni e corsi di formazione, promuovere la ricerca medico scientifica nel settore odontoiatrico, il tutto nel rispetto della legislazione vigente tempo per tempo; gestire l'addestramento e la formazione tecnica del personale di terzi di ogni livello nel rispetto della legislazione vigente tempo per tempo; compiere tutte le operazioni mobiliari ed assumere sia direttamente che indirettamente partecipazioni ed interessenze in altre societ\u00e0 o imprese aventi oggetto analogo e connesso al proprio. La societ\u00e0 potr\u00e0 inoltre compiere operazioni di investimento sia immobiliari che mobiliari, acquisire partecipazioni in imprese anche con oggetto diverso dal proprio, gestire le propriet\u00e0 acquisite sia nella confederazione che all'estero. Nuove azioni: 100 azioni nominative da CHF 1'000.00 [finora: 100 azioni al portatore da CHF 1'000.00]. Nuove comunicazioni: Le comunicazioni della societ\u00e0 agli azionisti avvengono mediante lettera raccomandata. Nuova limitazione della trasferibilit\u00e0: La trasferibilit\u00e0 delle azioni nominative \u00e8 limitata dallo statuto.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4043 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 17, Date: 26.01.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registro di commercio del Cantone Ticino", "company_name": "R.I.S. DENTAL SA (RESEARCH, IMPLANTHOLOGY AND SURGERY)", "address": "Via al Fiume 7", "zip_code": "6962", "town": "Viganello", "publication_title": "Change R.I.S. DENTAL SA (RESEARCH, IMPLANTHOLOGY AND SURGERY), Lugano", "url": "https://shab.ch/#!/search/publications/detail/ae56edb0-90c0-403f-b373-f92da31fea52", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC, Official Gazette TI - 11.03.2021", "publication_number": "HR02-1005121664", "journal_number": "4043", "journal_date": "08.03.2021"}
