{"UID": "CHE-424.157.522", "publication_text": "New entries Cugini SAGL, Locarno     Cugini SAGLVia Luigi Lavizzari 26600 Locarno             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Cugini SAGL, in Locarno, CHE-424.157.522, Via Luigi Lavizzari 2, 6600 Locarno, societ\u00e0 a garanzia limitata (Nuova iscrizione). Data dello statuto: 05.03.2021. Scopo: La gestione di esercizi pubblici, segnatamente di ristoranti, bar e pizzerie, nonch\u00e9 la gestione di chioschi, come pure la commercializzazione, compresa l'importazione e l'esportazione, la compravendita, la concessione in uso e la distribuzione di prodotti legati a tali esercizi pubblici e chioschi. La societ\u00e0 pu\u00f2 assumere sia direttamente che indirettamente interessenze e partecipazioni in altre societ\u00e0 o imprese industriali, commerciali, finanziarie e di servizi in Svizzera o all'estero, nel settore attinente allo scopo sociale o in altri settori ed aprire succursali e filiali in Svizzera e all'estero. La societ\u00e0 pu\u00f2 anche acquistare, valorizzare, gravare, gestire, amministrare e vendere beni immobili in Svizzera e all'estero, nonch\u00e9 partecipare a societ\u00e0 e imprese immobiliari con sede e/o attivit\u00e0 in Svizzera e all'estero compatibilmente con le norme vigenti, con particolare riferimento alla Legge federale sull'acquisto di fondi da parte di persone all'estero (LAFE). La societ\u00e0 pu\u00f2 infine compiere tutte le operazioni commerciali, industriali e finanziarie o di altro genere ritenute necessarie o utili, funzionalmente connesse con l'oggetto sociale o atte a conseguirlo. Capitale sociale: CHF 20'000.00. Obblighi di fornire prestazioni accessorie, diritti preferenziali, di prelazione o di compera: per i dettagli si rinvia allo statuto. Organo di pubblicazione: FUSC. Le comunicazioni della societ\u00e0 ai soci si effettuano per iscritto o per email. Secondo dichiarazione del 05.03.2021 la societ\u00e0 non \u00e8 soggetta alla revisione ordinaria e rinuncia a una revisione limitata. Persone iscritte: Smilkov, Igorco, da Locarno, in Locarno, socio e presidente della gerenza, con firma individuale, con 10 quote da CHF 1'000.00; Stoilkova, Spasena, da Muralto, in Muralto, socio e gerente, con firma individuale, con 10 quote da CHF 1'000.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 3969 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registro di commercio del Cantone Ticino", "company_name": "Cugini SAGL", "address": "Via Luigi Lavizzari 2", "zip_code": "6600", "town": "Locarno", "publication_title": "New entries Cugini SAGL, Locarno", "url": "https://shab.ch/#!/search/publications/detail/2ce53fbf-736a-4d1b-aff3-9af6669d4045", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC, Official Gazette TI - 11.03.2021", "publication_number": "HR01-1005121590", "journal_number": "no data", "journal_date": "no data"}
