{"UID": "CHE-113.992.430", "publication_text": "Change LVTK Cr\u00e9ations SA, Gen\u00e8ve, new LVTK Concept SA, Carouge (GE)     LVTK Concept SAc/o Gespower SARue Jacques-Grosselin 81227 Carouge GE           To date LVTK Cr\u00e9ations SARue de la Coulouvreni\u00e8re 171204 Gen\u00e8ve             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  LVTK Cr\u00e9ations SA, \u00e0 Gen\u00e8ve, CHE-113.992.430 (FOSC du 18.03.2019, p. 0/1004590299). Nouvelle raison sociale: LVTK Concept SA. Nouveau si\u00e8ge: Carouge (GE), Rue Jacques-Grosselin 8, c/o Gespower SA, 1227 Carouge GE. Nouveau but: le d\u00e9veloppement et la cr\u00e9ation de concept publicitaire et marketing dans le domaine du sport et des jeux sous n'importe quelle forme. La soci\u00e9t\u00e9 peut \u00e9galement cr\u00e9er des \u00e9v\u00e9nements et manifestations en lien avec son activit\u00e9 et d\u00e9velopper des applications pour t\u00e9l\u00e9phones dans tous types de domaines. Elle peut aussi commercialiser tout article ou bien du domaine de l'art et de la d\u00e9coration, ainsi que des articles de sport. La soci\u00e9t\u00e9 peut \u00e9galement accorder des pr\u00eats ou des garanties \u00e0 des actionnaires ou des tiers si cela favorise ses int\u00e9r\u00eats. La soci\u00e9t\u00e9 peut investir et prendre des participations dans d'autres soci\u00e9t\u00e9s, constituer des succursales et des filiales, tant en Suisse qu'\u00e0 l'\u00e9tranger ainsi qu'acqu\u00e9rir, d\u00e9tenir, g\u00e9rer, administrer et ali\u00e9ner des biens immobiliers. La soci\u00e9t\u00e9 peut exercer toutes les activit\u00e9s commerciales, financi\u00e8res et autres en rapport avec son but. Communication aux actionnaires: lettre ou courriel. Nouveaux statuts du 24.02.2021. Nouvel administrateur: Lorenzini Valentin, de Lancy, \u00e0 Veyrier, avec signature individuelle.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 5042 from 08.03.2021  