{"UID": "CHE-496.218.022", "publication_text": "New entries ALCHIMIA WINES AG, Emmetten     ALCHIMIA WINES AGSch\u00f6neckstrasse 276376 Emmetten             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  ALCHIMIA WINES AG, in Emmetten, CHE-496.218.022, Sch\u00f6neckstrasse 27, 6376 Emmetten, Aktiengesellschaft (Neueintragung). Statutendatum: 05.03.2021. Zweck: Die Gesellschaft bezweckt den Import und Vertrieb von und Engros- und Detailhandel mit Weinen und Spirituosen, den Betrieb von Kellereien sowie die Erbringung und Vermittlung von damit zusammenh\u00e4ngenden Dienstleistungen. Die Gesellschaft bezweckt zudem die Veredelung und Vermarktung von Weinerzeugnissen (prim\u00e4r aus Argentinien) und deren Vertrieb, insbesondere im EU-/ EWR-Raum, durch Handels-, Produktions- und Dienstleistungst\u00e4tigkeit. Die Gesellschaft kann Mobilien, Immobilien und Immaterialg\u00fcterrechte erwerben, belasten, ver\u00e4ussern und verwalten, sich an anderen Unternehmen (insbesondere im Bereich Weinhandel, Restauration und Hotellerie) beteiligen, Finanzierungs-, Anlage- und Darlehensgesch\u00e4fte t\u00e4tigen, B\u00fcrgschaften eingehen und Sicherheiten zugunsten Dritter leisten sowie alle Gesch\u00e4fte t\u00e4tigen, die geeignet sind, die Entwicklung des Unternehmens und die Erreichung des Gesellschaftszwecks zu f\u00f6rdern. Aktienkapital: CHF 100'000.00. Liberierung Aktienkapital: CHF 70'000.00. Aktien: 1'000 Namenaktien zu CHF 100.00. Publikationsorgan: SHAB. Mitteilungen an die Aktion\u00e4re erfolgen mit eingeschriebener Post an die im Aktienbuch eingetragene Adresse. Vinkulierung: Die \u00dcbertragbarkeit der Namenaktien ist nach Massgabe der Statuten beschr\u00e4nkt. Mit Erkl\u00e4rung vom 05.03.2021 wurde auf die eingeschr\u00e4nkte Revision verzichtet. Eingetragene Personen: Jans, Tomas Guillermo, deutscher Staatsangeh\u00f6riger, in Buenos Aires (AR), Pr\u00e4sident des Verwaltungsrates, mit Einzelunterschrift; Zurbr\u00fcgg, Gerardo, von Kandergrund, in Beckenried, Mitglied des Verwaltungsrates, mit Einzelunterschrift.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 382 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Nidwalden", "company_name": "ALCHIMIA WINES AG", "address": "Sch\u00f6neckstrasse 27", "zip_code": "6376", "town": "Emmetten", "publication_title": "New entries ALCHIMIA WINES AG, Emmetten", "url": "https://shab.ch/#!/search/publications/detail/d19b109e-b40b-4538-bb49-7603a68704d2", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121164", "journal_number": "no data", "journal_date": "no data"}
