{"UID": "CHE-300.589.824", "publication_text": "New entries Oechslin Mechanik GmbH, Einsiedeln     Oechslin Mechanik GmbHKieswerkstrasse 48840 Trachslau             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Oechslin Mechanik GmbH, in Einsiedeln, CHE-300.589.824, Kieswerkstrasse 4, 8840 Trachslau, Gesellschaft mit beschr\u00e4nkter Haftung (Neueintragung). Statutendatum: 25.02.2021. Zweck: Die Gesellschaft bezweckt Erbringen von mechanischen Arbeiten, Herstellung und Vertrieb von Maschinen sowie Handel mit Waren aller Art. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. Stammkapital: CHF 20'000.00. Qualifizierte Tatbest\u00e4nde: Sacheinlage/Sach\u00fcbernahme: Die Gesellschaft \u00fcbernimmt bei der Gr\u00fcndung das Gesch\u00e4ft des im Handelsregister eingetragenen Einzelunternehmens Oechslin Mechanik (CHE-417.767.000), in Einsiedeln, gem\u00e4ss Verm\u00f6gens\u00fcbertragungsvertrag vom 08.02.2021 und Bilanz per 31.12.2020 mit Aktiven von CHF 111'719.75 und Passiven (Fremdkapital) von CHF 5'437.95, wof\u00fcr 200 Stammanteile zu CHF 100.00 ausgegeben und CHF 86'281.80 als Forderung gutgeschrieben werden. Publikationsorgan: SHAB. Mitteilungen der Gesch\u00e4ftsf\u00fchrung an die Gesellschafter erfolgen per Brief, E-Mail oder Telefax an die im Anteilbuch verzeichneten Adressen. Gem\u00e4ss Erkl\u00e4rung vom 25.02.2021 untersteht die Gesellschaft keiner ordentlichen Revision und verzichtet auf eine eingeschr\u00e4nkte Revision. Eingetragene Personen: Oechslin, Andr\u00e9, von Einsiedeln, in Einsiedeln, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 200 Stammanteilen zu je CHF 100.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1474 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Schwyz", "company_name": "Oechslin Mechanik GmbH", "address": "Kieswerkstrasse 4", "zip_code": "8840", "town": "Trachslau", "publication_title": "New entries Oechslin Mechanik GmbH, Einsiedeln", "url": "https://shab.ch/#!/search/publications/detail/c3f19cd5-51f1-40f8-8c70-8f4fdf38eb13", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121126", "journal_number": "no data", "journal_date": "no data"}
