{"UID": "CHE-378.435.207", "publication_text": "Change AMF Medical SA, Ecublens (VD)     AMF Medical SA(AMF Medical AG) (AMF Medical Ltd)Chemin de la Dent-d'Oche 1 A1024 Ecublens VD             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  AMF Medical SA, \u00e0 Ecublens (VD), CHE-378.435.207 (FOSC du 19.01.2021, p. 0/1005077764). Signature collective \u00e0 deux est conf\u00e9r\u00e9e \u00e0 van Wesel Petrus, des Pays-Bas, \u00e0 Lutry, directeur. Confia Baden AG (CHE-108.378.017) n'est plus organe de r\u00e9vision. Nouvel organe de r\u00e9vision: Fiduconsult Lausanne SA (CHE-105.765.688), \u00e0 Lausanne. Statuts modifi\u00e9s le 12.02.2021. Nouveau but: la soci\u00e9t\u00e9 a pour but le d\u00e9veloppement et le commerce d'applications et de produits ainsi que la fourniture de prestations dans le domaine de la micro technologie, sp\u00e9cialement dans le domaine de la microfluidique. La soci\u00e9t\u00e9 peut constituer des succursales et des filiales en Suisse et \u00e0 l'\u00e9tranger et participer \u00e0 d'autres entreprises en Suisse et \u00e0 l'\u00e9tranger. La soci\u00e9t\u00e9 peut acqu\u00e9rir, d\u00e9tenir, g\u00e9rer, gager, mettre en valeur et ali\u00e9ner des droits de propri\u00e9t\u00e9 intellectuelle en Suisse et \u00e0 l'\u00e9tranger, ainsi que financer d'autres soci\u00e9t\u00e9s. La soci\u00e9t\u00e9 peut exercer toutes les activit\u00e9s commerciales, financi\u00e8res et autres aptes \u00e0 favoriser son but ou en rapport avec ce dernier. L'assembl\u00e9e g\u00e9n\u00e9rale a introduit une clause statutaire relative \u00e0 une augmentation autoris\u00e9e du capital par d\u00e9cision du 12.02.2021. Pour les d\u00e9tails, voir les statuts. L'assembl\u00e9e g\u00e9n\u00e9rale a introduit deux clauses statutaires relatives \u00e0 une augmentation conditionnelle du capital par d\u00e9cision du 12.02.2021. Pour les d\u00e9tails, voir les statuts. Nouvelles communications aux actionnaires: par annonce unique dans la Feuille officielle suisse du commerce, par courrier ou par courriel.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4713 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 12, Date: 19.01.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Canton de Vaud", "company_name": "AMF Medical SA", "address": "Chemin de la Dent-d'Oche 1 A", "zip_code": "1024", "town": "Ecublens VD", "publication_title": "Change AMF Medical SA, Ecublens (VD)", "url": "https://shab.ch/#!/search/publications/detail/942fb4ea-88c3-4eb3-af16-968bec9af965", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121698", "journal_number": "4713", "journal_date": "08.03.2021"}
{"UID": "CHE-255.579.295", "publication_text": "Change Auto-Music-Shop S\u00e0rl, Roche (VD)     Auto-Music-Shop S\u00e0rlZI la Coche 11852 Roche VD             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Auto-Music-Shop S\u00e0rl, \u00e0 Roche (VD), CHE-255.579.295 (FOSC du 21.12.2020, p. 0/1005053855). Statuts modifi\u00e9s le 25.02.2021. Nouveau but: la soci\u00e9t\u00e9 a pour but, tant en Suisse qu'\u00e0 l'\u00e9tranger, l'achat, la vente, la commercialisation, l'exportation, l'importation et la r\u00e9paration de tous articles et produits li\u00e9s \u00e0 la branche automobile, soit notamment de tous accessoires audio pour v\u00e9hicules automobiles, ainsi que toutes activit\u00e9s en rapport avec le but principal. La soci\u00e9t\u00e9 peut en outre: - effectuer, pour son compte ou pour le compte de tiers, toutes op\u00e9rations commerciales, financi\u00e8res ou industrielles, et conclure tous contrats propres \u00e0 d\u00e9velopper son but ou s'y rapportant directement ou indirectement; - accorder des pr\u00eats \u00e0 ses associ\u00e9s et \u00e0 des tiers; - cr\u00e9er des succursales ou des filiales en Suisse et \u00e0 l'\u00e9tranger, - s'int\u00e9resser, sous toutes formes, \u00e0 toutes entreprises similaires. Elle pourra de m\u00eame, dans la mesure n\u00e9cessaire \u00e0 ses besoins propres, acqu\u00e9rir tous immeubles \u00e0 usage d'\u00e9tablissement stable, les ali\u00e9ner et les grever de tous gages immobiliers.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4717 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 248, Date: 21.12.2020       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Canton de Vaud", "company_name": "Auto-Music-Shop S\u00e0rl", "address": "ZI la Coche 1", "zip_code": "