{"UID": "CHE-288.486.401", "publication_text": "New entries GRF Property AG, Lyss     GRF Property AG(GRF Property SA) (GRF Property SA) (GRF Property Ltd.)c/o Susanna GlutzFabrikstrasse 233250 Lyss             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  GRF Property AG (GRF Property SA) (GRF Property SA) (GRF Property Ltd.), in Lyss, CHE-288.486.401, c/o Susanna Glutz, Fabrikstrasse 23, 3250 Lyss, Aktiengesellschaft (Neueintragung). Statutendatum: 03.03.2021. Zweck: Die Gesellschaft bezweckt den Erwerb, die Bewirtschaftung und die Ver\u00e4usserung von Grundst\u00fccken sowie die Erbringung von damit im Zusammenhang stehenden Dienstleistungen im In- und Ausland. Die Gesellschaft kann im In- und Ausland Zweigniederlassungen errichten, sich an anderen Unternehmen im In- und Ausland beteiligen, gleichartige oder verwandte Unternehmen des In- und Auslandes erwerben oder sich mit solchen zusammenschliessen, Grundst\u00fccke erwerben, verwalten und ver\u00e4ussern sowie alle Gesch\u00e4fte eingehen und Vertr\u00e4ge abschliessen, die geeignet sind, den Zweck der Gesellschaft zu f\u00f6rdern oder die direkt oder indirekt damit im Zusammenhang stehen. Aktienkapital: CHF 100'000.00. Liberierung Aktienkapital: CHF 100'000.00. Aktien: 1'000 Namenaktien zu CHF 100.00. Qualifizierte Tatbest\u00e4nde: Die Gesellschaft beabsichtigt, nach der Gr\u00fcndung von der SPT Roth AG, in Lyss, CHE-105.976.788, gem\u00e4ss noch abzuschliessendem Vertrag, diverse Liegenschaften und fl\u00fcssige Mittel zum Werte von maximal CHF 50'000'000.00 ohne Gegenleistung zu \u00fcbernehmen. Publikationsorgan: SHAB. Mitteilungen an die Aktion\u00e4re: schriftlich oder mit elektronischer Post. Vinkulierung: Die \u00dcbertragbarkeit der Namenaktien ist nach Massgabe der Statuten beschr\u00e4nkt. Eingetragene Personen: Glutz, Peter, von Lohn-Ammannsegg und Derendingen, in Biel/Bienne, Pr\u00e4sident des Verwaltungsrates, mit Einzelunterschrift; Glutz-Roth, Susanna Chr