{"UID": "CHE-380.983.027", "publication_text": "New entries BunschiTec GmbH, Schattdorf     BunschiTec GmbHUmfahrungsstrasse 19a6467 Schattdorf             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  BunschiTec GmbH, in Schattdorf, CHE-380.983.027, Umfahrungsstrasse 19a, 6467 Schattdorf, Gesellschaft mit beschr\u00e4nkter Haftung (Neueintragung). Statutendatum: 05.03.2021. Zweck: Die Gesellschaft bezweckt die Erbringung von Dienstleistungen in den Bereichen Reparaturen und Unterhalt von Fahrzeugen, Maschinen und Anlagen, Industriemontagen sowie Handel mit Fahrzeugen, Maschinen und Ersatzteilen. Ferner kann die Gesellschaft mit Waren aller Art handeln. Die Gesellschaft kann zudem Grundeigentum erwerben, belasten, verwalten und ver\u00e4ussern. Sie kann auch im In- und Ausland Tochterunternehmen und Zweigniederlassungen gr\u00fcnden sowie sich an anderen Unternehmen beteiligen sowie Grundst\u00fccke erwerben. Sie kann Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen. Sie kann Urheberrechte, Patente und Lizenzen aller Art erwerben, belasten, verwalten und ver\u00e4ussern. Sie kann im \u00dcbrigen s\u00e4mtliche Gesch\u00e4fte t\u00e4tigen, die geeignet sind, die Entwicklung des Unternehmens sowie die Erreichung des Gesellschaftszwecks zu f\u00f6rdern. Stammkapital: CHF 20'000.00. Qualifizierte Tatbest\u00e4nde: Sacheinlage/Sach\u00fcbernahme: Die Gesellschaft \u00fcbernimmt bei der Gr\u00fcndung das Gesch\u00e4ft des im Handelsregister eingetragenen Einzelunternehmens BunschiTec (CHE-494.064.469), in Erstfeld, gem\u00e4ss Vertrag vom 05.03.2021 und \u00dcbernahmebilanz per 31.12.2020 mit Aktiven von CHF 61'110.42 und Passiven von CHF 40'190.80, wof\u00fcr 20 Stammanteile zu CHF 1'000.00.-- ausgegeben und CHF 919.62 als Forderung gutgeschrieben werden. Publikationsorgan: SHAB. Mitteilungen der Gesch\u00e4ftsf\u00fchrung an die Gesellschafter erfolgen per Brief oder per E-Mail an die im Anteilbuch verzeichneten Adressen. Gem\u00e4ss Erkl\u00e4rung vom 05.03.2021 untersteht die Gesellschaft keiner ordentlichen Revision und verzichtet auf eine eingeschr\u00e4nkte Revision. Eingetragene Personen: Bunschi, Joel, von B\u00fcrglen (UR), in Seedorf (UR), Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 20 Stammanteilen zu je CHF 1'000.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 150 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Uri", "company_name": "BunschiTec GmbH", "address": "Umfahrungsstrasse 19a", "zip_code": "6467", "town": "Schattdorf", "publication_title": "New entries BunschiTec GmbH, Schattdorf", "url": "https://shab.ch/#!/search/publications/detail/b6bbfaa0-a541-4726-a194-acccd5fca043", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121121", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-253.331.755", "publication_text": "New entries ONABOO GmbH, Luzern     ONABOO GmbHZentralstrasse 446003 Luzern             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  ONABOO GmbH, in Luzern, CHE-253.331.755, Zentralstrasse 44, 6003 Luzern, Gesellschaft mit beschr\u00e4nkter Haftung (Neueintragung). Statutendatum: 04.03.2021. Zweck: Die Gesellschaft bezweckt die Entwicklung, den Vertrieb von sowie den Handel mit Produkten im Bereich der Organisationsentwicklung im weiteren Sinn (inkl. Hard- und Software) sowie die Erbringung von damit verbundenen Dienstleistungen; den Erwerb, das alten, das Verwalten und die Ver\u00e4usserung von Marken, Urheberrechten, Patenten, Lizenzen und ganz allgemein von Immaterialg\u00fcterrechten jeder Art, insbesondere soweit sie mit den Hauptzwecken der Gesellschaft im Zusammenhang stehen; die \u00dcbernahme von oder Beteiligung an beliebigen Gesellschaften; ganz allgemein die Vornahme aller gesch\u00e4ftlichen, finanziellen und industriellen Operationen, auch mit Wertpapieren oder Immobilien, die direkt oder indirekt der Verfolgung der Hauptzwecke dienlich sind; die Gesellschaft kann namentlich Finanzierungen vornehmen und f\u00fcr Dritte Garantien und B\u00fcrgschaften eingehen; die Errichtung von Zweigniederlassungen im In- und Ausland. Stammkapital: CHF 30'000.00. Nebenleistungspflichten gem\u00e4ss n\u00e4herer Umschreibung in den Statuten. Publikationsorgan: SHAB. Mitteilungen erfolgen per Brief oder E-Mail. Mit Erkl\u00e4rung vom 04.03.2021 wurde auf die eingeschr\u00e4nkte Revision verzichtet. Eingetragene Personen: Leupi, Christian, von Dagmersellen, in Luzern, Gesellschafter und Vorsitzender der Gesch\u00e4ftsf\u00fchrung, mit Kollektivunterschrift zu zweien, mit 100 Stammanteilen zu je CHF 100.00; Grossenbacher, Nils, von Udligenswil, in Luzern, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Kollektivunterschrift zu zweien, mit 100 Stammanteilen zu je CHF 100.00; Keller L\u00