{"UID": "CHE-109.729.728", "publication_text": "Change ALSA PK, unabh\u00e4ngige Sammelstiftung, Eschenbach (SG), new Rapperswil-Jona     ALSA PK, unabh\u00e4ngige SammelstiftungRietstrasse 48640 Rapperswil SG           To date Frohburgstrasse 208732 Neuhaus SG             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  ALSA PK, unabh\u00e4ngige Sammelstiftung, in Eschenbach (SG), CHE-109.729.728, Stiftung (SHAB Nr. 207 vom 23.10.2020, Publ. 1005007018). Urkunden\u00e4nderung: 27.01.2021. Sitz neu: Rapperswil-Jona. Domizil neu: Rietstrasse 4, 8640 Rapperswil SG. Zweck neu: Die Stiftung bezweckt die berufliche Vorsorge im Rahmen des BVG und seiner Ausf\u00fchrungsbestimmungen f\u00fcr die Arbeitnehmer der ihr angeschlossenen Arbeitgeber sowie f\u00fcr deren Angeh\u00f6rige und Hinterlassenen gegen die wirtschaftlichen Folgen von Alter, Tod und Invalidit\u00e4t. Die Arbeitgeber oder die ihnen gleichgestellten Personen k\u00f6nnen sich im Rahmen der Vorschriften des BVG an die Stiftung aufgrund einer schriftlichen Anschlussvereinbarung anschliessen. Die Stiftung kann \u00fcber die gesetzlichen Mindestleistungen hinaus weitergehende Vorsorge betreiben, einschliesslich Unterst\u00fctzungsleistungen in Notlagen, wie bei Krankheit, Unfall, Invalidit\u00e4t oder Arbeitslosigkeit. Der Stiftungsrat erl\u00e4sst ein oder mehrere Reglemente \u00fcber die Vorsorgeleistungen, die Teilliquidation, die Organisation, die Verwaltung, die Verm\u00f6gensanlage und Finanzierung sowie \u00fcber die Kontrolle der Stiftung. Er legt darin insbesondere das Verh\u00e4ltnis zu den Arbeitgebern, zu den Versicherten und zu den weiteren Anspruchberechtigten fest. Reglemente k\u00f6nnen vom Stiftungsrat unter Wahrung der erworbenen Rechtsanspr\u00fcche der Destinat\u00e4re ge\u00e4ndert werden. \u00c4nderungen sind der Aufsichtsbeh\u00f6rde einzureichen. Die Stiftung erl\u00e4sst f\u00fcr jeden angeschlossenen Arbeitgeber einen individuellen Vorsorgeplan \u00fcber die versicherten Leistungen und deren Finanzierung. Zur Erreichen ihres Zweckes kann die Stiftung Versicherungsvertr\u00e4ge abschliessen oder in bestehende Vertr\u00e4ge eintreten, wobei sie selbst Versicherungsnehmerin und Beg\u00fcnstigte sein muss. [gestrichen: Die vor der Eintragung im Kanton St. Gallen gestrichenen Tatsachen, sowie allf\u00e4llige fr\u00fchere Statutendaten oder Tagebuch- und SHAB-Zitate k\u00f6nnen im Registerauszug des bisherigen Sitzes, welcher bei den abgelegten Handelsregisterakten liegt, eingesehen werden.]       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 2443 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 207, Date: 23.10.2020       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Amt f\u00fcr Handelsregister und Notariate Kanton SG", "company_name": "ALSA PK, unabh\u00e4ngige Sammelstiftung", "address": "Rietstrasse 4", "zip_code": "8640", "town": "Rapperswil SG", "publication_title": "Change ALSA PK, unabh\u00e4ngige Sammelstiftung, Eschenbach (SG), new Rapperswil-Jona", "url": "https://shab.ch/#!/search/publications/detail/f592e5cc-b6e4-4a3b-9ce4-be1502387cd3", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121401", "journal_number": "2443", "journal_date": "08.03.2021"}
