inzelunterschrift, mit 100 Stammanteilen zu je CHF 100.00; M\u00fcller, Rudolf, von Wiliberg, in Staffelbach, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 100 Stammanteilen zu je CHF 100.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 3107 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Aargau", "company_name": "M\u00fcller-M\u00fcller Schreinerei GmbH", "address": "Kalthof 6", "zip_code": "5053", "town": "Staffelbach", "publication_title": "New entries M\u00fcller-M\u00fcller Schreinerei GmbH, Staffelbach", "url": "https://shab.ch/#!/search/publications/detail/10c0083e-77a5-449f-a56c-4d0ee45b9834", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121541", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-197.066.428", "publication_text": "New entries SP Sylca Immobilier S\u00e0rl, Crissier     SP Sylca Immobilier S\u00e0rlChemin de la Colice 71023 Crissier             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  SP Sylca Immobilier S\u00e0rl, \u00e0 Crissier, Chemin de la Colice 7, 1023 Crissier, CHE-197.066.428. Nouvelle soci\u00e9t\u00e9 \u00e0 responsabilit\u00e9 limit\u00e9e. Statuts: 01.03.2021. But: la soci\u00e9t\u00e9 a pour but toutes op\u00e9rations immobili\u00e8res en Suisse, notamment le courtage, la g\u00e9rance, l'achat et la vente de biens immobiliers, la promotion immobili\u00e8re, ainsi que l'\u00e9tablissement de contrat d'entreprise g\u00e9n\u00e9rale; sont exclues toutes op\u00e9rations immobili\u00e8res soumises \u00e0 ou prohib\u00e9es par la Loi f\u00e9d\u00e9rale sur l'acquisition d'immeubles par des personnes \u00e0 l'\u00e9tranger. La soci\u00e9t\u00e9 peut: exercer toute activit\u00e9 financi\u00e8re, commerciale ou industrielle, mobili\u00e8re ou immobili\u00e8re, en rapport direct ou indirect avec son but; cr\u00e9er des succursales ou des filiales en Suisse et \u00e0 l'\u00e9tranger; participer \u00e0 toutes entreprises ayant un rapport direct ou indirect avec son but, acqu\u00e9rir de telles entreprises ou fusionner avec elles; accorder des pr\u00eats ou des garanties \u00e0 des associ\u00e9s, \u00e0 des filiales ou \u00e0 des tiers, si cela favorise ses int\u00e9r\u00eats. Obligation de fournir des prestations accessoires, droits de pr\u00e9f\u00e9rence, de pr\u00e9emption ou d'emption: pour les d\u00e9tails, voir les statuts. Capital social: CHF 20'000. Associ\u00e9-g\u00e9rant avec signature individuelle: Fort\u00e8s Pierre-Laurent, de Landiswil, \u00e0 Saint-Prex, avec 20 parts de CHF 1'000. Organe de publication: Feuille officielle suisse du commerce. Communications aux associ\u00e9s: par \u00e9crit ou par courriel. Selon d\u00e9claration du 01.03.2021, la soci\u00e9t\u00e9 n'est 