{"UID": "CHE-261.572.982", "publication_text": "New entries L\u00e9sine SA, Sion     L\u00e9sine SAAvenue de Tourbillon 1001950 Sion             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  L\u00e9sine SA, \u00e0 Sion, CHE-261.572.982, Avenue de Tourbillon 100, 1950 Sion, soci\u00e9t\u00e9 anonyme (Nouvelle inscription). Date des statuts: 15.02.2021. But: La soci\u00e9t\u00e9 a pour but principal: principalement, d\u00e9tention de participations commerciales, industrielles, financi\u00e8res et immobili\u00e8res, dans le respect de la LFAIE. Secondairement, le conseil en d\u00e9veloppement industriel et commercial, partenariat d'entreprise. Elle peut effectuer toutes op\u00e9rations en rapport avec cette activit\u00e9 ainsi que toutes op\u00e9rations de nature \u00e0 favoriser le but et l'int\u00e9r\u00eat de la soci\u00e9t\u00e9. Elle peut cr\u00e9er des succursales en Suisse et \u00e0 l'\u00e9tranger, participer \u00e0 d'autres entreprises en Suisse et \u00e0 l'\u00e9tranger, acqu\u00e9rir des entreprises visant des buts analogues, fusionner avec de telles entreprises et conclure tous contrats propres \u00e0 d\u00e9velopper ou \u00e0 atteindre son but ou s'y rapportant directement ou indirectement. Elle peut accorder ou recevoir des pr\u00eats de/en faveur de ses actionnaires, de m\u00eame qu'envers toutes soci\u00e9t\u00e9s du m\u00eame groupe. Capital-actions: CHF 100'000.00. Capital-actions lib\u00e9r\u00e9: CHF 100'000.00. Actions: 10'000 actions nominatives de CHF 10.00 li\u00e9es selon statuts. Faits qualifi\u00e9s: Apport en nature: la soci\u00e9t\u00e9 reprend 50 actions au porteur de CHF 1'000.00, enti\u00e8rement lib\u00e9r\u00e9es, de la soci\u00e9t\u00e9 anonyme CUCHET SA, \u00e0 Sion (CHE-109.048.284) au prix de CHF 50'000.00 selon le contrat du 15.02.2021; 5'000 actions nominatives de CHF 10.00, li\u00e9es selon statuts, enti\u00e8rement lib\u00e9r\u00e9es sont remises en contrepartie. Organe de publication: FOSC. Communication aux actionnaires: convocation \u00e0 l'assembl\u00e9e g\u00e9n\u00e9rale par avis ins\u00e9r\u00e9 dans la FOSC, par lettre recommand\u00e9e ou par courriel avec accus\u00e9 de r\u00e9ception si les adresses \u00e9lectroniques de tous les actionnaires sont connues et toute autre communication par \u00e9crit ou par courriel. Personne(s) inscrite(s): Beaud, Matthieu, ressortissant fran\u00e7ais, \u00e0 Longchaumois (FR), pr\u00e9sident du conseil d'administration, avec signature individuelle; Laffin, Fran\u00e7ois Xavier, de Savi\u00e8se, \u00e0 Savi\u00e8se, administrateur, avec signature individuelle. Selon d\u00e9claration du 15.02.2021, il est renonc\u00e9 \u00e0 un contr\u00f4le restreint.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1057 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Valais Central", "company_name": "L\u00e9sine SA", "address": "Avenue de Tourbillon 100", "zip_code": "1950", "town": "Sion", "publication_title": "New entries L\u00e9sine SA, Sion", "url": "https://shab.ch/#!/search/publications/detail/3d4abbe9-682f-4571-9810-30e7bbb0421c", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121774", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-160.648.168", "publication_text": "New entries AISA GROUP HOLDING S\u00e0rl, Gen\u00e8ve     AISA GROUP HOLDING S\u00e0rlRue Robert-C\u00e9ard 121204 Gen\u00e8ve             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  AISA GROUP HOLDING S\u00e0rl, \u00e0 Gen\u00e8ve, Rue Robert-C\u00e9ard 12, 1204 Gen\u00e8ve, CHE-160.648.168. Nouvelle soci\u00e9t\u00e9 \u00e0 responsabilit\u00e9 limit\u00e9e. Statuts du 01.03.2021. But: tant en Suisse qu'\u00e0 l'\u00e9tranger, offre de tous conseils, services et prestations, de m\u00eame qu'exercice de toute activit\u00e9 dans le domaine immobilier, notamment des mandats de courtage, de pilotage et d'expertise, acquisition, vente, d\u00e9tention, gestion, administration, promotion, d\u00e9veloppement et courtage de biens immobiliers, ainsi que prise de participations dans des soci\u00e9t\u00e9s immobili\u00e8res; la soci\u00e9t\u00e9 peut effectuer soit pour son propre compte, soit pour le compte de tiers, toutes op\u00e9rations financi\u00e8res, commerciales, industrielles, mobili\u00e8res et immobili\u00e8res (\u00e0 l'exclusion des op\u00e9rations prohib\u00e9es par la LFAIE), en Suisse et \u00e0 l'\u00e9tranger, se rattachant directement ou indirectement au but principal; elle peut cr\u00e9er des succursales en Suisse et \u00e0 l'\u00e9tranger; elle peut prendre des participations dans d'autres soci\u00e9t\u00e9s. Obligation de fournir des prestations accessoires, droits de pr\u00e9f\u00e9rence, de pr\u00e9emption ou d'emption: pour les d\u00e9tails, voir les statuts. Capital: CHF 20'000. Organe de publication: Feuille Officielle Suisse du Commerce. Communication aux associ\u00e9s: par \u00e9crit (courrier ou courriel). Associ\u00e9s-g\u00e9rants: Sursock Axel, de et \u00e0 Collonge-Bellerive, pr\u00e9sident, et Martinez Arevalo Sergio Antonio, du Salvador, \u00e0 Gen\u00e8ve, chacun pour 100 parts de CHF 100, tous deux avec signature individuelle. Selon d\u00e9claration du 01