{"UID": "CHE-107.857.373", "publication_text": "Change Union Mara\u00eech\u00e8re de Gen\u00e8ve soci\u00e9t\u00e9 coop\u00e9rative, Perly-Certoux     Union Mara\u00eech\u00e8re de Gen\u00e8ve soci\u00e9t\u00e9 coop\u00e9rativeroute de Base 451258 Perly             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Union Mara\u00eech\u00e8re de Gen\u00e8ve soci\u00e9t\u00e9 coop\u00e9rative, \u00e0 Perly-Certoux, CHE-107.857.373 (FOSC du 25.10.2019, p. 0/1004745658). Nouveau but: de d\u00e9fendre et promouvoir les int\u00e9r\u00eats professionnels et \u00e9conomiques de ses membres :1 en vendant, en son nom mais pour leur compte, les produits de ses membres en prenant toutes dispositions utiles visant \u00e0 garantir la meilleure strat\u00e9gie commerciale; 2 en garantissant la marque d'origine, ceci notamment par une publicit\u00e9 et les mesures financi\u00e8res appropri\u00e9es; 3 en garantissant, dans le cadre de son activit\u00e9 commerciale, \u00e0 sauvegarder et d\u00e9velopper les parts de march\u00e9; 4 en soutenant l'association des Mara\u00eechers du Genevois (AMDG) auquel chaque membre actif genevois et zonien est obligatoirement affili\u00e9; 5 en effectuant toutes d\u00e9marches, vis-\u00e0-vis de tiers, en rapport avec le but social; toute autre prestation rendue par la soci\u00e9t\u00e9 pour le compte de ses membres et non pr\u00e9vue par l'alin\u00e9a pr\u00e9c\u00e9dent, fera l'objet d'une facturation. Statuts modifi\u00e9s le 18.01.2021 y compris sur un point non soumis \u00e0 publication. Blondin Bernard n'est plus administrateur. Stalder Christophe, de L\u00fctzelfl\u00fch, \u00e0 Meyrin, est administrateur sans signature sociale.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 5082 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 207, Date: 25.10.2019       \u2002\u