{"UID": "CHE-101.361.748", "publication_text": "Change Mecky's T&T Trade and Trust Company Ltd, Z\u00fcrich     Mecky's T&T Trade and Trust Company LtdBadenerstrasse 3298003 Z\u00fcrich             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Mecky's T&T Trade and Trust Company Ltd, in Z\u00fcrich, CHE-101.361.748, Aktiengesellschaft (SHAB Nr. 100 vom 26.05.2016, S.0, Publ. 2852403). Statuten\u00e4nderung: 02.03.2021. Zweck neu: Zweck der Gesellschaft ist der Handel und die Verwaltung s\u00e4mtlicher G\u00fcter im nationalen und internationalen Handel, insbesondere der Erwerb, Verwaltung und Ver\u00e4usserung von Gesellschaften und Beteiligungen sowie diverse Dienstleistungen im Bereich der Jurisprudenz. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen. Die Gesellschaft kann Grundst\u00fccke und Liegenschaften erwerben, halten und ver\u00e4ussern. Die Gesellschaft kann alle kommerziellen, finanziellen und andere T\u00e4tigkeiten aus\u00fcben, die den Zweck der Gesellschaft f\u00f6rdern und ihm dienen. Aktien neu: 100 Namenaktien zu CHF 1'000.00 [bisher: 50 Inhaberaktien zu CHF 1'000.00 und 50 Namenaktien zu CHF 1'000.00].       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 10134 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 100, Date: 26.05.2016       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Z\u00fcrich", "company_name": "Mecky's T&amp;T Trade and Trust Company Ltd", "address": "Badenerstrasse 329", "zip_code": "8003", "town": "Z\u00fcrich", "publication_title": "Change Mecky's T&T Trade and Trust Company Ltd, Z\u00fcrich", "url": "https://shab.ch/#!/search/publications/detail/2581ec67-a0