{"UID": "CHE-139.045.126", "publication_text": "New entries Dr. Dulla Fachzahn\u00e4rzte AG, Sargans     Dr. Dulla Fachzahn\u00e4rzte AGGrossfeldstrasse 797320 Sargans             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Dr. Dulla Fachzahn\u00e4rzte AG, in Sargans, CHE-139.045.126, Grossfeldstrasse 79, 7320 Sargans, Aktiengesellschaft (Neueintragung). Statutendatum: 02.03.2021. Zweck: Die Gesellschaft bezweckt Erbringung zahnmedizinischer Dienstleistungen jeglicher Art; besonders auf den Spezialgebieten der Kieferorthop\u00e4die, Oralchirurgie und Stomatologie. Ferner Investition in und Bereitstellung und Gebrauchs\u00fcberlassung von Betriebsst\u00e4tten, Einrichtungen der Gesundheitspflege und damit verbundenen Gesch\u00e4ftsbereiche, Erbringung aller damit zusammenh\u00e4ngender Dienstleistungen, insbesondere Planung, Finanzierung und Bereitstellung solcher Infrastruktur bzw. Projekte; aber auch s\u00e4mtliche mit dem Betrieb verbundenen Beratungs- und Managementdienstleistungen sowie Bereitstellung von Personal, Betriebsmitteln und anderen mit dem Betrieb einer Gesundheitseinrichtung erforderlichen Ressourcen. Die Gesellschaft kann selbst ein zahnmedizinisches Institut betreiben, Dritten die Infrastruktur f\u00fcr Durchf\u00fchrung zahnmedizinischer Dienstleistungen zur Verf\u00fcgung stellen, sich insbesondere an anderen Unternehmen im In- und Ausland beteiligen, solche finanzieren, Tochtergesellschaften und Zweigniederlassungen im In- und Ausland errichten, im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten, Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. Aktienkapital: CHF 100'000.00. Liberierung Aktienkapital: CHF 100'000.00. Aktien: 1'000 Namenaktien zu CHF 100.00. Publikationsorgan: SHAB. Mitteilungen an die Aktion\u00e4re erfolgen durch eingeschriebenen Brief. Vinkulierung: Die \u00dcbertragbarkeit der Namenaktien ist nach Massgabe der Statuten beschr\u00e4nkt. Gem\u00e4ss Erkl\u00e4rung des Verwaltungsrates vom 02.03.2021 untersteht die Gesellschaft keiner ordentlichen Revision und verzichtet auf eine eingeschr\u00e4nkte Revision. Eingetragene Personen: Dulla, Dr. med. dent. Marc Andr\u00e9, von Walenstadt, in Walenstadt, Mitglied des Verwaltungsrates, mit Einzelunterschrift.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 2434 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Amt f\u00fcr Handelsregister und Notariate Kanton SG", "company_name": "Dr. Dulla Fachzahn\u00e4rzte AG", "address": "Grossfeldstrasse 79", "zip_code": "7320", "town": "Sargans", "publication_title": "New entries Dr. Dulla Fachzahn\u00e4rzte AG, Sargans", "url": "https://shab.ch/#!/search/publications/detail/2eca929a-3ff8-4aa1-bae5-f128cfed79b7", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121393", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-305.779.941", "publication_text": "New entries Schreinerei Bleuler AG, Dietikon     Schreinerei Bleuler AGBinzstrasse 58953 Dietikon             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Schreinerei Bleuler AG, in Dietikon, CHE-305.779.941, Binzstrasse 5, 8953 Dietikon, Aktiengesellschaft (Neueintragung). Statutendatum: 25.02.2021. Zweck: Die Gesellschaft bezweckt den Betrieb einer M\u00f6bel- und Innenausbauschreinerei. Insbesondere legt sie dabei Wert auf eine individuelle und einmalige Gestaltung der M\u00f6bel und lnnenausbauten. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Sicherheiten f\u00fcr Verbindlichkeiten verbundener Gesellschaften abgeben. Aktienkapital: CHF 100'000.00. Liberierung Aktienkapital: CHF 100'000.00. Aktien: 1'000 Namenaktien zu CHF 100.00. Qualifizierte Tatbest\u00e4nde: Sacheinlage/Sach\u00fcbernahme: Die Gesellschaft \u00fcbernimmt bei der Gr\u00fcndung das Gesch\u00e4ft des im Handelsregister eingetragenen Einzelunternehmens Bleuler Schreinerei, in Z\u00fcrich (CHE-103.779.478), gem\u00e4ss Vertrag vom 25.02.2021 und \u00dcbernahmebilanz per 31.12.2020 mit Aktiven von CHF 366180.05 und Passiven von CHF 260'687.83, wof\u00fcr 1'000 Namenaktien zu CHF 100.00 ausgegeben und CHF 5'492.22 als Forderung gutgeschrieben werden. Publikationsorgan: SHAB. Mitteilungen an die Aktion\u00e4re erfolgen per Brief, E-Mail oder Telefax an die im Aktienbuch verzeichneten Adressen. Vinkulierung: Die \u00dcbertragbarkeit der Namenaktien ist nach Massgabe der Statuten beschr\u00e4nkt. Gem\u00e4ss Erkl\u00e4