{"UID": "CHE-176.179.110", "publication_text": "Change Creative Connections GmbH, Hinwil, new MYGOSH GmbH, Z\u00fcrich     MYGOSH GmbHM\u00fchlebachstrasse 728008 Z\u00fcrich           To date Creative Connections GmbHD\u00fcrntnerstrasse 12A8340 Hinwil             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Creative Connections GmbH, in Hinwil, CHE-176.179.110, Gesellschaft mit beschr\u00e4nkter Haftung (SHAB Nr. 141 vom 24.07.2018, Publ. 4376939). Statuten\u00e4nderung: 18.02.2021. Firma neu: MYGOSH GmbH. Sitz neu: Z\u00fcrich. Domizil neu: M\u00fchlebachstrasse 72, 8008 Z\u00fcrich. Zweck neu: Die Gesellschaft bezweckt die Entwicklung, Produktion, Vermarktung und Verwertung von und den Handel mit Foto-, Film-, Ton-, Event-, Multimedia-, Internet- und verwandten Produkten, das Erbringen von Dienstleistungen aller Art in diesen Bereichen, einschliesslich Management, Consulting, Produktion, Schulung, Personalvermittlung, Regie, Casting und dergleichen, sowie den Betrieb einer Gallerie. Weiter bezweckt die Gesellschaft den Betrieb einer Vermittlungs- und Produktionsagentur. Diese stellt den Kontakt zwischen Auftraggebern und k\u00fcnstlerischen Auftragnehmern her (Fotografen, Illustratoren, Filmschaffenden, Komponisten etc.), erstellt Vorschl\u00e4ge und L\u00f6sungen f\u00fcr die Realisierung und Produktion und f\u00fchrt s\u00e4mtliche zugeh\u00f6renden administrativen Leistungen aus. Sie kann alle Gesch\u00e4fte durchf\u00fchren, die mit dem Gesellschaftszweck direkt oder indirekt in Zusammenhang stehen und kann sich ferner an anderen Gesellschaften und Unternehmungen beteiligen, welche gleiche, \u00e4hnliche oder verwandte Ziele verfolgen. Sie kann im In- und Ausland Zweigniederlassungen errichten, sich an anderen Unternehmungen des In- und Auslandes beteiligen, gleichartige oder verwandte Unternehmen erwerben oder errichten, Liegenschaften, Lizenzen, Patente oder andere immaterielle Werte erwerben, verwalten, vermitteln oder ver\u00e4ussern sowie alle Gesch\u00e4fte eingehen und Vertr\u00e4ge abschliessen, die geeignet sind, den Zweck der Gesellschaft zu f\u00f6rdern oder die direkt oder indirekt mit ihm in Zusammenhang stehen. Nebenleistungspflichten, Vorhand-, Vorkaufs- oder Kaufsrechte gem\u00e4ss n\u00e4herer Umschreibung in den Statuten. Mitteilungen neu: Die Mitteilungen der Gesch\u00e4ftsf\u00fchrung an die Gesellschafter erfolgen schriftlich oder per E-Mail.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 10097 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 141, Date: 24.07.2018       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Z\u00fcrich", "company_name": "MYGOSH GmbH", "address": "M\u00fchlebachstrasse 72", "zip_code": "8008", "town": "Z\u00fcrich", "publication_title": "Change Creative Connections GmbH, Hinwil, new MYGOSH GmbH, Z\u00fcrich", "url": "https://shab.ch/#!/search/publications/detail/c1fc0719-6c4f-49a8-bbec-d68366fa2af0", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005120894", "journal_number": "10097", "journal_date": "08.03.2021"}
