{"UID": "CHE-107.796.808", "publication_text": "Change Furrer Treuhand AG, Muttenz     Furrer Treuhand AGHofackerstrasse 3a4132 Muttenz             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Furrer Treuhand AG, in Muttenz, CHE-107.796.808, Aktiengesellschaft (SHAB Nr. 113 vom 14.06.2019, Publ. 1004651368). Statuten\u00e4nderung: 03.03.2021. Zweck neu: Betrieb eines Treuhand- und Revisionsb\u00fcros. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Sicherheiten f\u00fcr Verbindlichkeiten verbundener Gesellschaften abgeben. Aktien neu: 50 vinkulierte Namenaktien zu CHF 1'000.00 [bisher: 50 Inhaberaktien zu CHF 1'000.00]. Mitteilungen neu: Mitteilungen an die Aktion\u00e4re erfolgen per Brief oder E-Mail an die im Aktienbuch verzeichneten Adressen. Vinkulierung neu: Die \u00dcbertragbarkeit der Namenaktien ist nach Massgabe der Statuten beschr\u00e4nkt. Ausgeschiedene Personen und erloschene Unterschriften: Kohler, Hans Peter, von L\u00fcsslingen, in Lupsingen, Mitglied des Verwaltungsrates, mit Einzelunterschrift. Eingetragene Personen neu oder mutierend: Herzog, Mike Peter, deutscher Staatsangeh\u00f6riger, in Riehen, Vizedirektor, mit Kollektivunterschrift zu zweien [bisher: in L\u00f6rrach (DE)]; Kahraman, Altay, von Oensingen, in Oensingen, mit Kollektivunterschrift zu zweien.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1304 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 113,