{"UID": "CHE-443.264.644", "publication_text": "New entries Zatec GmbH, Cham     Zatec GmbH(Zatec S\u00e0rl) (Zatec Sagl) (Zatec LLC)Langackerstrasse 396330 Cham             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Zatec GmbH (Zatec S\u00e0rl) (Zatec Sagl) (Zatec LLC), in Cham, CHE-443.264.644, Langackerstrasse 39, 6330 Cham, Gesellschaft mit beschr\u00e4nkter Haftung (Neueintragung). Statutendatum: 26.02.2021. Zweck: Die Gesellschaft bezweckt die Erbringung von technischen Dienstleistungen und Beratungen sowie den Handel mit Waren aller Art. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen sowie alle Gesch\u00e4fte t\u00e4tigen, die direkt oder indirekt mit ihrem Zweck in Zusammenhang stehen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. Stammkapital: CHF 20'000.00. Publikationsorgan: SHAB. Mitteilungen erfolgen per Brief, E-Mail oder Telefax. Mit Erkl\u00e4rung vom 28.12.2020 wurde auf die eingeschr\u00e4nkte Revision verzichtet. Eingetragene Personen: Zanuco, Alessandro Lino, von Appenzell, in Cham, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 200 Stammanteilen zu je CHF 100.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 3856 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregister- und Konkursamt des Kantons Zug", "company_name": "Zatec GmbH", "address": "Langackerstrasse 39", "zip_code": "6330", "town": "Cham", "publication_title": "New entries Zatec GmbH, Cham", "url": "https://shab.ch/#!/search/publications/detail/4b09d396-7