{"UID": "CHE-273.864.486", "publication_text": "New entries Michael Enderle Management GmbH, Frauenfeld     Michael Enderle Management GmbH(Michael Enderle Management LLC) (Michael Enderle Management S\u00e0rl)Am Stadtbach 88500 Frauenfeld             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Michael Enderle Management GmbH (Michael Enderle Management LLC) (Michael Enderle Management S\u00e0rl), in Frauenfeld, CHE-273.864.486, Am Stadtbach 8, 8500 Frauenfeld, Gesellschaft mit beschr\u00e4nkter Haftung (Neueintragung). Statutendatum: 05.03.2021. Zweck: Die Gesellschaft bezweckt, Dienstleistungen in den Bereichen Unternehmensberatung, Interimsmanagement, Personalberatung und Eventmanagement zu erbringen. Die Gesellschaft kann zudem Vertriebs- und Handelsaktivit\u00e4ten aller Art betreiben, insbesondere im Softwarebereich. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmen im In- und Ausland beteiligen. Ferner kann die Gesellschaft Patente, Marken, Designs und andere Immaterialg\u00fcterrechte sowie Lizenzrechte daran erwerben, halten, verwerten oder verkaufen. Die Gesellschaft kann im In- und Ausland Grundeigentum erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen sowie alle Rechtshandlungen vornehmen, die der Zweck der Gesellschaft mit sich bringen kann oder die geeignet sind, ihre Entwicklung oder diejenige von Gruppengesellschaften zu f\u00f6rdern. Stammkapital: CHF 20'000.00. Nebenleistungspflichten, Vorhand-, Vorkaufs- oder Kaufsrechte gem\u00e4ss n\u00e4herer Umschreibung in den Statuten. Publikationsorgan: SHAB. Mitteilungen der Gesch\u00e4ftsf\u00fchrung an die Gesellschafter erfolgen per Brief oder E-Mail an die im Anteilbuch verzeichneten Adressen. Die Gesellschaft hat mit Erkl\u00e4rung vom 05.03.2021 auf die eingeschr\u00e4nkte Revision verzichtet. Eingetragene Personen: Enderle, Michael, von St. Gallen, in Frauenfeld, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 160 Stammanteilen zu je CHF 100.00; Enderle, Nathalie, von St. Gallen, in Z\u00fcrich, Gesellschafterin, mit Kollektivunterschrift zu zweien, mit 20 Stammanteilen zu je CHF 100.00; Enderle, Raphael, von St. Gallen, in Frauenfeld, Gesellschafter, mit Kollektivunterschrift zu zweien, mit 20 Stammanteilen zu je CHF 100.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1284 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Thurgau", "company_name": "Michael Enderle Management GmbH", "address": "Am Stadtbach 8", "zip_code": "8500", "town": "Frauenfeld", "publication_title": "New entries Michael Enderle Management GmbH, Frauenfeld", "url": "https://shab.ch/#!/search/publications/detail/c7799330-0950-4e52-bb4b-b6305c432108", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121561", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-379.915.504", "publication_text": "New entries SECUMATHICS S\u00e0rl, Montreux     SECUMATHICS S\u00e0rl(SECUMATHICS GmbH) (SECUMATHICS Sagl) (SECUMATHICS Ltd liab Co)Grand-Rue 901820 Montreux             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  SECUMATHICS S\u00e0rl (SECUMATHICS GmbH) (SECUMATHICS Sagl) (SECUMATHICS Ltd liab Co), \u00e0 Montreux, Grand-Rue 90, 1820 Montreux, CHE-379.915.504. Nouvelle soci\u00e9t\u00e9 \u00e0 responsabilit\u00e9 limit\u00e9e. Statuts: 03.03.2021. But: la soci\u00e9t\u00e9 a le but suivant: Fourniture de services et de conseils en mati\u00e8re de gestion d'entreprises, de ressources humaines, de marketing et de communication; fourniture de services et de conseils en mati\u00e8re juridique; fourniture de services dans les domaines du d\u00e9veloppement du personnel, de la formation continue, de la s\u00e9curit\u00e9 des produits, de la s\u00e9curit\u00e9 des services et dans le conseil aux entreprises; fourniture de services de consulting en d\u00e9veloppement de produits et services; fourniture de services en mati\u00e8re fiscale, fiduciaire, financi\u00e8re ainsi qu'en mati\u00e8re d'audit et de comptabilit\u00e9. Elle pourra en outre faire, soit pour son compte, soit pour le compte de tiers, toutes op\u00e9rations financi\u00e8res, commerciales, mobili\u00e8res ou immobili\u00e8res se rattachant directement ou indirectement \u00e0 son but social et s'int\u00e9resser, sous toutes formes, \u00e0 toutes entreprises similaires, notamment par la prise de participation dans des entreprises similaires. La soci\u00e9t\u00e9 pourra \u00e9galement constituer des succursales et des filiales en Suisse et \u00e0 l'\u00e9tranger. Obligation de fournir des prestations accessoires, droits de pr\u00e9f\u00e9rence, de pr\u00e9emption ou d'emption: pour les d\u00e9tails, voir les statuts. Capital social: CHF 20'000. Associ\u00e9s-g\u00e9rants avec signature collective \u00e0 deux: Rausis Jean, de Orsi\u00e8res, \u00e0 Morges, avec 50 parts de CHF 100, pr\u00e9sident, et Rabl Eric, de Weggis, \u00e0 Montreux, avec 150 parts de CHF 100. Organe de publication: Feuille officielle suisse du commerce. Communications aux associ\u00e9s: par \u00e9crit ou par courriel. Selon d\u00e9claration du 03.03.2021, la soci\u00e9t\u00e9 n'est pas soumise \u00e0 une r\u00e9vision ordinaire et renonce \u00e0 une r\u00e9vision restreinte.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 4710 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Registre du commerce du Canton de Vaud", "company_name": "SECUMATHICS S\u00e0rl", "address": "Grand-Rue 90", "zip_code": "1820", "town": "Montreux", "publication_title": "New entries SECUMATHICS S\u00e0rl, Montreux", "url": "https://shab.ch/#!/search/publications/detail/445e2e6c-422d-4812-828e-295ea79ec83e", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121695", "journal_number": "no data", "journal_date": "no data"}
{"UID": "CHE-217.968.661", "publication_text": "New entries VIVAT MULTITALENT ROMANDIE (VMR) SA, La Tour-de-Peilz     VIVAT MULTITALENT ROMANDIE (VMR) SAc/o Claude Dalla PalmaAvenue de Sully 1261814 La Tour-de-Peilz             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  VIVAT MULTITALENT ROMANDIE (VMR) SA, \u00e0 La Tour-de-Peilz, Avenue de Sully 126, c/o Claude Dalla Palma, 1814 La Tour-de-Peilz, CHE-217.968.661. Nouvelle soci\u00e9t\u00e9 anonyme. Statuts: 17.02.2021. But: la soci\u00e9t\u00e9 aura pour but toutes activit\u00e9s dans les domaines immobiliers et mobiliers, ceci \u00e0 l'exception des op\u00e9rations prohib\u00e9es par la Loi f\u00e9d\u00e9rale sur l'acquisition d'immeubles par des personnes \u00e0 l'\u00e9tranger (LFAIE), les services administratifs, la formation et l'\u00e9v\u00e9nementiel. La soci\u00e9t\u00e9 peut: exercer toute activit\u00e9 financi\u00e8re, commerciale ou industrielle, mobili\u00e8re ou immobili\u00e8re, en rapport direct ou indirect avec son but, \u00e0 l'exception des op\u00e9rations prohib\u00e9es par la Loi f\u00e9d\u00e9rale sur l'acquisition d'immeubles par des personnes \u00e0 l'\u00e9tranger (LFAIE); cr\u00e9er des succursales ou des filiales en Suisse et \u00e0 l'\u00e9tranger; participer \u00e0 toutes entreprises ayant un rapport direct ou indirect avec son but; accorder des pr\u00eats ou des garanties \u00e0 des actionnaires ou des tiers, si cela favorise ses int\u00e9r\u00eats. Capital-actions: CHF 100'000, enti\u00e8rement lib\u00e9r\u00e9, divis\u00e9 en 1'000 actions nominatives de CHF 100, avec restrictions quant \u00e0 la transmissibilit\u00e9 selon statuts. Organe de publication: Feuille officielle suisse du commerce. Administration: Lecureux Pierre-Yves, de Arogno, \u00e0 Ollon, pr\u00e9sident, avec signature collective \u00e0 deux, Dalla Palma Claude, de Vevey, \u00e0 La Tour-de-Peilz, vice-pr\u00e9sident, avec signature collective \u00e0 deux sont membres du conseil d