{"UID": "CHE-101.528.126", "publication_text": "Change Fortuna Investment AG, Adliswil, new Generali Investments Schweiz AG     Generali Investments Schweiz AG(Generali Investments Switzerland Ltd.) (Generali Investments Suisse SA) (Generali Investments Svizzera SA)Soodmattenstrasse 108134 Adliswil           To date Fortuna Investment AG              \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Fortuna Investment AG, in Adliswil, CHE-101.528.126, Aktiengesellschaft (SHAB Nr. 252 vom 28.12.2020, Publ. 1005058789). Statuten\u00e4nderung: 10.02.2021. Firma neu: Generali Investments Schweiz AG. Uebersetzungen der Firma neu: (Generali Investments Switzerland Ltd.) (Generali Investments Suisse SA) (Generali Investments Svizzera SA). Zweck neu: Hauptzweck der Gesellschaft ist die Aus\u00fcbung des Fondsgesch\u00e4fts, insbesondere die Gr\u00fcndung, Leitung und Verwaltung von schweizerischen kollektiven Kapitalanlagen sowie die Erbringung damit verbundener Dienstleistungen, die eine Fondsleitung aus\u00fcben darf, insbesondere: 1. \u00dcbernahme der Vertretung ausl\u00e4ndischer kollektiver Kapitalanlagen; 2. Erwerb von Beteiligungen an Gesellschaften im In- und Ausland, deren Hauptzweck das kollektive Kapitalanlagegesch\u00e4ft ist sowie Gr\u00fcndung von Tochtergesellschaften und Zweigniederlassungen im Inland; 3. F\u00fchrung von Anteilskonten; 4. Vertrieb von in- und ausl\u00e4ndischen kollektiven Kapitalanlagen in der Schweiz; 5. Erbringung administrativer Dienstleistungen f\u00fcr in- und ausl\u00e4ndische kollektive Kapitalanlagen und \u00e4hnliche Verm\u00f6gen (wie beispielsweise interne Sonderverm\u00f6gen, Anlagestiftungen und Investmentgesellschaften); 6. Erbringung von Dienstleistungen im Fondsgesch\u00e4ft f\u00fcr Dritte. Neben der Aus\u00fcbung des Fondsgesch\u00e4fts darf die Gesellschaft insbesondere folgende weitere Dienstleistungen erbringen: 1. Dienstleistungen zur Aufbewahrung und technischer Verwaltung in- und ausl\u00e4ndischer kollektiver Kapitalanlagen; 2. Dienstleistungen in Form von Verm\u00f6gensverwaltung und Anlageberatung (haupts\u00e4chlich f\u00fcr inl\u00e4ndische Pensionskassen sowie in- und ausl\u00e4ndische Versicherungsgesellschaften); 3. Gew\u00e4hrung von Hypothekarkrediten und damit verbundenen Aufgaben wie das Mahn- und Betreibungswesen oder Reporting-Dienstleistungen im Auftrag von inl\u00e4ndischen Pensionskassen sowie in- und ausl\u00e4ndischen Versicherungsgesellschaften; 4. Kauf und Verkauf von Liegenschaften sowie das Baumanagement bei Sanierungen und Umbauten von Liegenschaften im Auftrag von inl\u00e4ndischen Pensionskassen sowie in- und ausl\u00e4ndischen Versicherungsgesellschaften; 5. Portfoliomanagement- und Reporting-Dienstleistungen im Zusammenhang mit Liegenschaften im Auftrag von inl\u00e4ndischen Pensionskassen sowie in- und ausl\u00e4ndischen Versicherungsgesellschaften. Die Gesellschaft kann ihre eigenen Mittel im Rahmen der jeweils aktuell geltenden gesetzlichen, regulatorischen und vertraglichen Bestimmungen frei anlegen sowie get\u00e4tigte Anlagen wieder ver\u00e4ussern. Dazu geh\u00f6ren auch Anlagen in Grundst\u00fccke im Inland. Sie kann weiter alle Gesch\u00e4fte t\u00e4tigen, die geeignet sind, den Zweck der Gesellschaft direkt oder in- direkt zu f\u00f6rdern. Vorbehalten bleiben die Bestimmungen des Finanzinstitutsgesetzes, Finanzdienstleistungsgesetzes, Kollektivanlagengesetzes und der Aufsichtsbeh\u00f6rde.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 10111 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 252, Date: 28.12.2020       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Z\u00fcrich", "company_name": "Generali Investments Schweiz AG", "address": "Soodmattenstrasse 10", "zip_code": "8134", "town": "Adliswil", "publication_title": "Change Fortuna Investment AG, Adliswil, new Generali Investments Schweiz AG", "url": "https://shab.ch/#!/search/publications/detail/e17906db-44fe-47b9-a976-8b94fc783ffd", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005120908", "journal_number": "10111", "journal_date": "08.03.2021"}
