e Stutbuchf\u00fchrung. Sie f\u00f6rdert Veranstaltungen im Zusammenhang mit dem arabischen Pferd. Mitteilungen neu: Bekanntmachungen an die Mitglieder erfolgen im Infobulletin der SZAP, an deren E-Mail-Adresse oder durch Mitteilung mit normaler Post.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 1316 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Previous publication in the SOGC: Number 28, Date: 11.02.2020       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Basel-Landschaft", "company_name": "Schweizer Zuchtgenossenschaft f\u00fcr Arabische Pferde", "address": "Erlenhof 8", "zip_code": "4441", "town": "Th\u00fcrnen", "publication_title": "Change Schweizer Zuchtgenossenschaft f\u00fcr Arabische Pferde, K\u00fcssnacht (SZ), new Th\u00fcrnen", "url": "https://shab.ch/#!/search/publications/detail/bdb406fd-76cd-4923-9f8e-50a5d5ae39bf", "category": "Commercial Registry entries", "subcategory": "Change", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR02-1005121348", "journal_number": "1316", "journal_date": "08.03.2021"}
