{"UID": "CHE-379.988.615", "publication_text": "New entries docconsult GmbH, Sarnen     docconsult GmbHChappelenmatt 26062 Wilen (Sarnen)             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  docconsult GmbH, in Sarnen, CHE-379.988.615, Chappelenmatt 2, 6062 Wilen (Sarnen), Gesellschaft mit beschr\u00e4nkter Haftung (Neueintragung). Statutendatum: 05.03.2021. Zweck: Die Gesellschaft bezweckt das Erbringen von Dienstleistungen in den Bereichen Unternehmens- und Managementberatung, Coaching, Aus-/Weiterbildung, Marketing und Werbung sowie Handel von Waren und Vermittlung von Dienstleistungen. Die Gesellschaft bezweckt ferner die Beratung, Suche, Selektion, Vermittlung von Personal sowie tempor\u00e4re F\u00fchrungsaufgaben. Die Gesellschaft kann alle Gesch\u00e4fte eingehen und Vertr\u00e4ge abschliessen, die geeignet sind, den Zweck der Gesellschaft zu f\u00f6rdern, oder die direkt oder indirekt damit in Zusammenhang stehen. Die Gesellschaft kann ferner alle kommerziellen und finanzellen Transaktionen durchf\u00fchren, welche dieser Zweckbestimmung dienen. Die Gesellschaft kann Zweigniederlassungen und Tochtergesellschaften im In- und Ausland errichten und sich an anderen Unternehmungen im In- und Ausland beteiligen. Die Gesellschaft kann im In- und Ausland Grundeigentum, Beteiligungen, Wertschriften, Patente, Lizenzen und sonstige Rechte erwerben, belasten, ver\u00e4ussern und verwalten. Sie kann auch Finanzierungen f\u00fcr eigene oder fremde Rechnung vornehmen sowie Garantien und B\u00fcrgschaften f\u00fcr Tochtergesellschaften und Dritte eingehen. Stammkapital: CHF 20'000.00. Publikationsorgan: SHAB. Die Mitteilungen der Gesch\u00e4ftsf\u00fchrung an die Gesellschafter erfolgen schriftlich oder per E-Mail. Gem\u00e4ss Gr\u00fcndererkl\u00e4rung vom 05.03.2021 untersteht die Gesellschaft keiner ordentlichen Revision und verzichtet auf eine eingeschr\u00e4nkte Revision. Eingetragene Personen: Knoll, Marcus, deutscher Staatsangeh\u00f6riger, in Sarnen, Gesellschafter und Gesch\u00e4ftsf\u00fchrer, mit Einzelunterschrift, mit 200 Stammanteilen zu je CHF 100.00.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 286 from 08.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Contact point: Handelsregisteramt des Kantons Obwalden", "company_name": "docconsult GmbH", "address": "Chappelenmatt 2", "zip_code": "6062", "town": "Wilen (Sarnen)", "publication_title": "New entries docconsult GmbH, Sarnen", "url": "https://shab.ch/#!/search/publications/detail/96c9714f-c2c1-42d5-99fb-6e51f83f8f7a", "category": "Commercial Registry entries", "subcategory": "New entry", "publication_date": "SOGC - 11.03.2021", "publication_number": "HR01-1005121157", "journal_number": "no data", "journal_date": "no data"}
