{"UID": "CHE-463.271.825", "publication_text": "Change DGM group SA, Lugano     DGM group SARa C\u00farta 116967 Dino             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  DGM group SA, in Lugano, CHE-463.271.825, societ\u00e0 anonima (Nr. FUSC 7 del 13.01.2020, Pubbl. 1004802917). Statuti modificati: 16.02.2021. Nuovo scopo: L'attivit\u00e0 di commercializzazione, import-export, vendita diretta e online di accessori e ricambi di veicoli a motore ed elettrici, nuovi e d'occasione, in particolare di autovetture, autocarri, autobus, moto, scooter, camper e biciclette elettriche; il noleggio di autovetture e di furgoni; la gestione di autolavaggi e carrozzerie; la commercializzazione dei relativi prodotti di consumo. Import-export, vendita diretta e online di impianti di illuminazione LED, impianti elettrici in corrente debole, insegne luminose, prodotti elettronici e oggettistica per case, uffici e dei relativi prodotti di consumo. La Societ\u00e0 potr\u00e0 pure acquistare, vendere, ricevere in uso e concedere in uso tecnologie, know-how tecnico, brevetti industriali, marchi, licenze e diritti di propriet\u00e0 intellettuale in genere, in particolare nei citati settori e assumere partecipazioni in altre societ\u00e0 o imprese in Svizzera o all'estero, nonch\u00e9 aprire succursali e filiali in Svizzera e all'estero. La Societ\u00e0 potr\u00e0 inoltre acquistare, vendere e amministrare beni immobili in Svizzera e all'estero, nonch\u00e9 partecipare a societ\u00e0 e imprese immobiliari, compatibilmente alle norme vigenti. L'attivit\u00e0 nel campo immobiliare \u00e8 limitata a beni immobili aziendali. La Societ\u00e0 potr\u00e0 compiere tutte le operazioni commerciali, industriali e finanziarie, necessarie o utili, connesse con l'oggetto sociale o atte a conseguirne lo scopo.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Journal Number 3996 from 08.03.2021       \u2002\u2002  \u2002\u2002