{"UID": "CHE-231.450.127", "publication_text": "New entries Ganpower Sagl, Agno     Ganpower Sagl(Ganpower GmbH) (Ganpower S\u00e0rl) (Ganpower Ltd. liab. Co)Via Lugano 136982 Agno             \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Ganpower Sagl (Ganpower GmbH) (Ganpower S\u00e0rl) (Ganpower Ltd. liab. Co), in Agno, CHE-231.450.127, Via Lugano 13, 6982 Agno, societ\u00e0 a garanzia limitata (Nuova iscrizione). Data dello statuto: 26.02.2021. Scopo: La societ\u00e0 mira a sviluppare soluzioni convenienti in termini di costi nella conversione di energia rinnovabile e nei dispositivi di immagazzinamento elettrico. La fornitura di energia pulita nelle case e negli uffici nel modo pi\u00f9 efficiente possibile. L'adempimento dello scopo aziendale attraverso la ricerca nel settore delle batterie al litio, dei sistemi di gestione delle batterie, degli inverter solari e degli alimentatori. La societ\u00e0 pu\u00f2 acquistare, detenere e realizzare diritti su beni immateriali ed immobili sia in Svizzera che all'estero. Pu\u00f2 acquistare, gestire, addebitare e vendere propriet\u00e0, diritti di propriet\u00e0 intellettuale e licenze di ogni tipo. Pu\u00f2 costituire filiali sul territorio nazionale e all'estero nonch\u00e9 partecipare ad altre societ\u00e0. La societ\u00e0 potr\u00e0 acquisire societ\u00e0 simili o collegate o associate ad esse, nonch\u00e9 concludere transazioni e contratti idonei a promuovere lo scopo dell'azienda. La societ\u00e0 potr\u00e0 svolgere qualsiasi altra attivit\u00e0 affine o connessa al raggiungimento degli scopi societari. Capitale sociale: CHF 20'000.00. Obblighi di fornire prestazioni accessorie, diritti preferenziali, di prelazione o di compera: per i dettagli si rinvia allo statuto. Organo di pubblicazione: FUSC. Le comunicazioni della societ\u00e0 ai soci si effettuano per iscritto o per email. Secondo dichiarazione del 26.02.2021 la societ\u00e0 non \u00e8 soggetta alla revisione ordinaria e 