ert, den Gl\u00e4ubiger f\u00fcr die angegebenen Forderungen binnen 20 Tagen zu befriedigen. Will der Schuldner die Forderung oder einen Teil derselben oder das Recht, sie auf dem Betreibungswege geltend zu machen, bestreiten, so hat er dies innert 10 Tagen seit der Ver\u00f6ffentlichung des Zahlungsbefehls der Kontaktstelle m\u00fcndlich oder schriftlich zu erkl\u00e4ren (Rechtsvorschlag zu erheben). Wird die Forderung nur zum Teil bestritten, so ist der bestrittene Betrag ziffernm\u00e4ssig genau anzugeben, ansonst die ganze Forderung als bestritten gilt. Sollte der Schuldner dem Zahlungsbefehl nicht nachkommen, so kann der Gl\u00e4ubiger die Fortsetzung der Betreibung verlangen. Publikation nach SchKG 69.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Point de contact                   \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Remarks Die vorstehende Publikation nach Art. 66 Abs. 4 Ziff. 2 SchKG ersetzt die direkte Zustellung der Konkursandrohung an den Schuldner.Krastins Arvils (Direktor+Liquidator) entzog sich der Zustellung. Er ist nach \"unbekannt\" abgereist.", "company_name": "AB Connect AG in Liquidation", "address": "Bahnhofstrasse 41", "zip_code": "5000", "town": "Aarau", "publication_title": "Payment order AB Connect AG in Liquidation", "url": "https://shab.ch/#!/search/publications/detail/81356208-6aed-4bb2-87b4-fdfb3d6a99fc", "category": "Debt enforcement", "subcategory": "Payment order", "publication_date": "SOGC - 11.03.2021", "publication_number": "SB02-0000023404", "journal_number": "no data", "journal_date": "no data"}
