(art. 169 CC), le conjoint du d\u00e9biteur ou du tiers propri\u00e9taire entend contester tout ou partie de la dette, le droit du cr\u00e9ancier d'exercer des poursuites ou tout ou partie du droit de gage, il doit former opposition au point de contact, verbalement ou par \u00e9crit, dans les dix jours \u00e0 compter de la publication du commandement de payer. Le d\u00e9biteur poursuivi, le tiers propri\u00e9taire ou le conjoint du d\u00e9biteur ou du tiers propri\u00e9taire qui ne conteste qu'une partie de la dette doit indiquer exactement le montant contest\u00e9, faute de quoi la dette enti\u00e8re est r\u00e9put\u00e9e contest\u00e9e. S'il ne conteste qu'une partie du droit de gage, il doit indiquer exactement les objets ou la partie de la cr\u00e9ance pour lesquels le droit de gage est contest\u00e9, faute de quoi celui-ci est r\u00e9put\u00e9 contest\u00e9 int\u00e9gralement. Si le d\u00e9biteur n'obtemp\u00e8re pas \u00e0 la sommation de payer, le cr\u00e9ancier pourra requ\u00e9rir la vente du gage.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Point de contact                   \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Remarks Gage : Feuillet no 75 du ban de Haute-Sorne-Undervelier, Route du Pichoux 8", "company_name": "Ana Paula Brahier", "address": "2863 Undervelier<span style=\"background-color: transparent;color: rgb(51,51,51);font-size: 13px;\">", "zip_code": "Partie", "town": "pour le Br\u00e9sil", "publication_title": "Payment order Ana Paula Brahier", "url": "https://shab.ch/#!/search/publications/detail/16be4da3-c956-4b46-b688-988aaf1fad2f", "category": "Debt enforcement", "subcategory": "Payment order", "publication_date": "SOGC - 11.03.2021", "publication_number": "SB02-0000023293", "journal_number": "no data", "journal_date": "no data"}
