{"UID": "CHE-133.530.937", "publication_text": "Provisional announcement of bankruptcy Sofiswiss SA      Debtor  \u2002\u2002    \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  \u2002\u2002    \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Sofiswiss SA\u200b\u200bCHE-133.530.937Dorfplatz 169107 Urn\u00e4sch                     \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002         \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Date of the dissolution decision: 09.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002                    \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Legal notice Schuldner des Konkursiten k\u00f6nnen ihre Schulden nicht mehr durch Zahlung an den Konkursiten begleichen; sie riskieren, zweimal bezahlen zu m\u00fcssen. Ferner sind Personen, die Verm\u00f6gensgegenst\u00e4nde des Konkursiten verwahren, unabh\u00e4ngig vom Rechtstitel der Verwahrung, verpflichtet, diese unverz\u00fcglich dem Konkursamt herauszugeben. Die Publikation betreffend Art, Verfahren, Eingabefrist usw. erfolgt sp\u00e4ter. Publikation nach Art. 222 SchKG.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Company dissolved under Art. 731b CO       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Point de contact Konkursamt Appenzell Ausserrhoden,Nordin Aemisegger, Stellvertretende Konkursbeamtin,Paradiesweg 2, Postfach 42, 9410 Heiden AR                  \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Remarks Fr\u00fcheres Domizil der Sofiswiss SA war an der Kantonsstrasse 14, 8807 Freienbach SZ. Das Kantonsgerichts-Pr\u00e4sidium von Appenzell Ausserrhoden hat mit Entscheid vom 03.02.2021 bez\u00fcglich der genannten Gesellschaft in Anwendung von Art. 731b OR die Aufl\u00f6sung per 03.02.2021 verf\u00fcgt und gleichzeitig die Liquidation nach den Vorschriften \u00fcber den Konkurs angeordnet. Vollstreckungserkl\u00e4rung mit Wirkung ab 09.03.2021. Es erfolgt hiermit die Aufforderung an die Schuldner der Sofiswiss SA, 9107 Urn\u00e4sch AR, sich unverz\u00fcglich beim Konkursamt zu melden. Personen, welche Sachen der Sofiswiss SA, 9107 Urn\u00e4sch AR, besitzen oder bei denen die Sofiswiss SA, 9107 Urn\u00e4sch AR, Guthaben hat, haben die Sachen und Guthaben etc. unverz\u00fcglich dem Konkursamt zur Verf\u00fcgung zu stellen. Es wird hiermit bei Unterlassung ausdr\u00fccklich auf Art. 324 StGB verwiesen.", "company_name": "Sofiswiss SA", "address": "Dorfplatz 16", "zip_code": "9107", "town": "Urn\u00e4sch", "publication_title": "Provisional announcement of bankruptcy Sofiswiss SA", "url": "https://shab.ch/#!/search/publications/detail/4d96c853-9471-41ff-b04b-fa552b3b4e82", "category": "Bankruptcies", "subcategory": "Prior notification of launch of bankruptcy proceedings", "publication_date": "SOGC, Official Gazette AR, Official Gazette ZH - 11.03.2021", "publication_number": "KK01-0000013570", "journal_number": "no data", "journal_date": "no data"}
