{"UID": "CHE-375.060.393", "publication_text": "Collocation plan and inventory Auto Buser AG Rheingarage      Debtor  \u2002\u2002    \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  \u2002\u2002    \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Auto Buser AG Rheingarage\u200b\u200bCHE-375.060.393Rheinstrasse 954410 Liestal                     \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Legal notice Ein Gl\u00e4ubiger, der den Kollokationsplan anfechten will, weil seine Forderung ganz oder teilweise abgewiesen oder nicht im beanspruchten Rang zugelassen worden ist, muss innert 20 Tagen nach der \u00f6ffentlichen Auflage des Kollokationsplanes beim angegebenen Gericht am Konkursort gegen die Masse klagen. Will er die Zulassung eines anderen Gl\u00e4ubigers oder dessen Rang bestreiten, so muss er die Klage gegen den Gl\u00e4ubiger richten. Publikation nach Art. 221 und 249-250 SchKG.       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Additional legal info Anmeldestelle f\u00fcr Forderungen, Einsprachen oder Rekurse:Kollokationsplan:Zivilkreisgericht Basel-Landschaft Ost, 4450 Sissach Inventar:Kantonsgericht Basel-Landschaft, Aufsichtsbeh\u00f6rde \u00fcber SchKG, 4410 Liestal       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Filing period for the schedule of claims: 20 daysEntryDeadline: 31.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002  Deadline for contesting the inventory: 10 daysEntryDeadline: 22.03.2021       \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Filing office for documents Betreibungs- und Konkursamt des Kantons Basel-Landschaft - Abteilung Konkurse, Eichenweg 12, 4410 Liestal                  \u2002\u2002  \u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002\u2002 Remarks Verwertungshandlungen im Konkurs:Sofern die Mehrheit der bekannten Gl\u00e4ubiger bis zum 22.03.2021 (Datum Poststempel) beim Konkursamt nicht schriftlich Einsprache erhebt, erachtet sich die Konkursverwaltung als erm\u00e4chtigt, die vorhandenen Aktiven (Corvette C1, Transportanh\u00e4nger Woodford Trailer RL5-042, Schneer\u00e4umungsmaschine, Maschine zur Pneumontage) freih\u00e4ndig zu ver\u00e4ussern. Stillschweigen gilt als Zustimmung. Eigentumsansprachen sind ebenfalls bis zum 22.03.2021 anzumelden Innert gleicher Frist k\u00f6nnen schriftliche Kaufangebote eingereicht werden. Gem\u00e4ss Art. 256 Abs. 3 SchKG ist den Gl\u00e4ubigern Gelegenheit zu bieten, bei freih\u00e4ndigem Verkauf von Verm\u00f6gensst\u00fccken von bedeutendem Wert und Grundst\u00fccken, h\u00f6here Angebote zu unterbreiten. Gl\u00e4ubiger, die verlangen, dass ihnen Offerten zwecks \u00dcberbietens unterbreitet werden, haben sich innert gleicher Frist beim Konkursamt zu melden. Andernfalls wird angenommen, dass sie ausdr\u00fccklich auf dieses Recht verzichten. Angebote k\u00f6nnen f\u00fcr einzelne oder alle Inventarpositionen en bloc abgegeben werden. Die Konkursverwaltung beh\u00e4lt sich nach erfolgter formeller Pr\u00fcfung der Angebote vor, diejenigen weiterzuverfolgen, welche die Interessen der Gl\u00e4ubigergemeinschaft am besten vertreten. Das entscheidende Kriterium ist das Nettoergebnis f\u00fcr die Konkursmasse unter Ber\u00fccksichtigung der Entlastung der Mietforderungen im Konkurs. Aufgrund der besonderen Umst\u00e4nde (COVID-19) findet keine \u00f6ffentliche Besichtigung statt.", "company_name": "Auto Buser AG Rheingarage", "address": "Rheinstrasse 95", "zip_code": "4410", "town": "Liestal", "publication_title": "Collocation plan and inventory Auto Buser AG Rheingarage", "url": "https://shab.ch/#!/search/publications/detail/9561bc5a-13af-4437-8135-46d5bfd81743", "category": "Bankruptcies", "subcategory": "Schedule of claims and inventory", "publication_date": "SOGC - 11.03.2021", "publication_number": "KK04-0000018057", "journal_number": "no data", "journal_date": "no data"}
